charts/axis.html.body:
d2b › Chart Axis



# d2b.chartAxis()
Constructs a new axis chart generator with the default settings.
When using the d2b-axis generator you can draw an axis chart onto each element in the selection.

# axis(context)
Render the axis chart(s) to the given context, which may be either a d3-selection of html containers (e.g. div) or a corresponding d3-transition.
Before applying the d2b-axis-chart generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var axis = d2b.chartAxis();

axis.chartFrame().size({height: 400});

var chart = d3.selectAll('.axis-chart');

var data = {
  sets: [
    {
      yType: 'y2',
      generators: [d2b.svgBar().padding(0.5).stackBy(true)],
      graphs: [
        {
          label: 'bar 1',
          values: [
            {x: 1, y: 25},
            {x: 2, y: 38},
            {x: 3, y: 24},
            {x: 4, y: 60},
            {x: 5, y: 22}
          ]
        },
        {
          label: 'bar 2',
          values: [
            {x: 3, y: 45},
            {x: 5, y: 31},
          ]
        },
        {
          label: 'bar 3',
          values: [
            {x: 2, y: 25},
            {x: 3, y: 15},
            {x: 4, y: 35},
            {x: 5, y: 25},
            {x: 6, y: 18},
          ]
        }
      ]
    },
    {
      generators: [d2b.svgArea(), d2b.svgLine(), d2b.svgScatter()],
      graphs: [
        {
          label: 'area 1',
          hidden: true,
          values: [
            {x: 1, y: 25},
            {x: 2, y: 38},
            {x: 3, y: 24},
            {x: 4, y: 60},
            {x: 5, y: 22}
          ]
        },
        {
          label: 'area 2',
          hidden: true,
          values: [
            {x: 3, y: 45},
            {x: 5, y: 31},
          ]
        }
      ]
    }
  ]
};

chart
    .datum(data)
  .transition()
    .call(axis);


# axis.chartFrame([chartFrame])
If chartFrame is specified, sets the chartFrame generator to the specified d2b.chartFrame and returns the axis-chart generator. If chartFrame is not specified, returns the current chartFrame generator, which defaults to d2b.chartFrame().legendEnabled(true).breadcrumbsEnabled(false).
The chartFrame can be configured at will.

# axis.plane([plane])
If plane is specified, sets the plane generator to the specified d2b.plane and returns the axis-chart generator. If plane is not specified, returns the current plane generator, which defaults to d2b.plane().
The chartFrame can be configured at will, except for the size, x, y, x2, y2, and axis properties which will be set automatically by the axis-chart.

# axis.legend([legend])
If legend is specified, sets the legend generator to the specified d2b.legend and returns the axis-chart generator. If legend is not specified, returns the current legend generator, which defaults to d2b.legend().clickable(true).dblclickable(true).
The legend can be configured at will, except for the html, color, key, empty, setEmpty, and values properties which will be set automatically by the pie-chart.
Datum Level Accessors
When the d2b axis-chart generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d.

# axis.tooltipConfig([tooltipConfig])
If tooltipConfig is specified, sets the tooltipConfig to the specified accessor function and returns the axis-chart generator. If tooltipConfig is not specified, returns the current tooltipConfig accessor, which defaults to:
function (d) {
  return d.tooltipConfig;
}

The tooltip-config function that is returned will be supplied with the d2b.tooltipAxis that is being used to render the axis chart.

# axis.duration([duration])
If duration is specified, sets the duration of the internal chart transitions to the specified accessor function or value and returns the axis-chart generator. If duration is not specified, returns the current duration accessor, which defaults to () => 250.

# axis.annotation([d3-annotation])
If d3-annotation is specified, sets the annotation generator to the specified d3-annotation and returns the axis-chart generator. If d3-annotation is not specified, returns the current annotation generator, which defaults to a d3.annotation().

# area.annotations([annotations])
If annotations is specified, sets the annotations accessor to the specified accessor function and returns the axis-chart generator. If annotations is not specified, returns the current annotations accessor, which defaults to:
function (d) {
  return d.annotations;
}


# axis[axisType]([config])
If config is specified, sets the config-accessor to the specified function or object. If config is not specified, returns the current config-accessor. The default config-accessor is d => {}.
In addition to the datum, the config-accessor is passed an array of points that will be rendered on this axis's scale. Here is an example of an axis configuration that is dynamic based on the values:
function (d, points) {
  return {
    scale: d3.scaleLinear()
      .domain([d3.min(points) || 0, d3.max(points) || 0]),

    // The rest of the attributes in this object will propagate directly to
    // the d2b.plane() that the axis chart is using.

    label: 'People (in millions)',

  };
}


# axis.x([x])
See axis[axisType].

# axis.y([y])
See axis[axisType].

# axis.x2([x2])
See axis[axisType].

# axis.y2([y2])
See axis[axisType].

# axis.groups([groups])
If groups is specified, sets the groups array to the specified accessor function or array and returns the axis-chart generator. If groups is not specified, returns the current groups accessor, which defaults to:
function (d) {
  return d.groups;
}


# axis.sets([sets])
If sets is specified, sets the sets array to the specified accessor function or array and returns the axis-chart generator. If sets is not specified, returns the current sets accessor, which defaults to:
function (d) {
  return d.sets;
}

Group Level Accessors
When the d2b axis-chart generator is applied to a selection, the following properties will be invoked for each group in the groups array. The function will be passed the group data d.

# axis.groupColor([groupColor])
If groupColor is specified, sets the groupColor accessor to the specified accessor function and returns the axis chart generator. If groupColor is not specified, returns the current groupColor accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(axis.groupLabel()(d));
}


# axis.groupLabel([groupLabel])
If groupLabel is specified, sets the groupLabel accessor to the specified accessor function and returns the axis chart generator. If groupLabel is not specified, returns the current groupLabel accessor, which defaults to:
function (d) {
  return d.label;
}

Set Level Accessors
When the d2b axis-chart generator is applied to a selection, the following properties will be invoked for each set in the sets array. The function will be passed the group data d.

# axis.setKey([key])
If key is specified, sets the set-key accessor and returns the axis chart generator. If key is not specified, returns the current set-key accessor, which defaults to:
function (d, i) {
  return i;
}

Note: In addition to the set datum d, the set-key accessor is also passed the set index in the sets array.

# axis.setGenerators([setGenerators])
If setGenerators is specified, sets the setGenerators accessor to the specified accessor function and returns the axis chart generator. If setGenerators is not specified, returns the current setGenerators accessor, which defaults to:
function (d) {
  return d.generators;
}


# axis.setXType([type])
If type is specified, sets the type accessor to the specified accessor function and returns the axis chart generator. If type is not specified, returns the current type accessor, which defaults to:
function (d) {
  return d.xType;
}

The set's x-type should be either 'x' or 'x2'. If the accessor returns falsy then an x-type of 'x' will be used.

# axis.setYType([type])
If type is specified, sets the type accessor to the specified accessor function and returns the axis chart generator. If type is not specified, returns the current type accessor, which defaults to:
function (d) {
  return d.yType;
}

The set's y-type should be either 'y' or 'y2'. If the accessor returns falsy then an y-type of 'y' will be used.

# axis.setGraphs([setGraphs])
If setGraphs is specified, sets the setGraphs accessor to the specified accessor function and returns the axis chart generator. If setGraphs is not specified, returns the current setGraphs accessor, which defaults to:
function (d) {
  return d.graphs;
}

Graph Level Accessors
When the d2b axis-chart generator is applied to a selection, the following properties will be invoked for each graph in the graphs array. The function will be passed the graph data d.

# axis.graphColor([graphColor])
If graphColor is specified, sets the graphColor accessor to the specified accessor function and returns the axis chart generator. If graphColor is not specified, returns the current graphColor accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(axis.graphLabel()(d));
}


# axis.graphLabel([graphLabel])
If graphLabel is specified, sets the graphLabel accessor to the specified accessor function and returns the axis chart generator. If graphLabel is not specified, returns the current graphLabel accessor, which defaults to:
function (d) {
  return d.label;
}


# axis.graphGroup([graphGroup])
If graphGroup is specified, sets the graphGroup accessor to the specified accessor function and returns the axis chart generator. If graphGroup is not specified, returns the current graphGroup accessor, which defaults to:
function (d) {
  return d.group;
}

If a falsy graph is not associated with any group it will be considered to be in it's own group. The graph-group should correspond to one of the groups' label.

# axis.graphAnnotations([annotations])
If annotations is specified, sets the graph-annotations accessor to the specified accessor function and returns the axis-chart generator. If annotations is not specified, returns the current graph-annotations accessor, which defaults to:
function (d) {
  return d.annotations;
}


# axis.graphTooltipConfig([graphTooltipConfig])
If graphTooltipConfig is specified, sets the graphTooltipConfig to the specified accessor function and returns the axis-chart generator. If graphTooltipConfig is not specified, returns the current graphTooltipConfig accessor, which defaults to:
function (d) {
  return d.tooltipConfig;
}

The tooltip-config function that is returned will be supplied with the d2b.tooltipAxis that is being used to render the axis chart.
If a graphTooltipConfig is specified, it will override the tooltipConfig that may be specified for the entire chart.
Annotation Level Accessors
When the d2b axis-chart generator is applied to a selection, the following properties will be invoked for each annotation in the annotations array as well as the annotations in each graphAnnotations array. The function will be passed the annotation data d.

# axis.annotationKey([key])
If key is specified, sets the annotation-key accessor and returns the axis chart generator. If key is not specified, returns the current annotation-key accessor, which defaults to:
function (d, i) {
  return i;
}

Note: In addition to the set datum d, the annotation-key accessor is also passed the annotation index. The annotations and graphAnnotations are first all compiled together and so their index will reflect this. Additionally, the keys of all annotations must be unique otherwise they will conflict with one another.

# axis.annotationXType([type])
If type is specified, sets the annotation-x-type accessor to the specified accessor function and returns the axis chart generator. If type is not specified, returns the current annotation-x-type accessor, which defaults to:
function (d) {
  return d.xType;
}

The annotation's x-type should be either 'x' or 'x2'. If the accessor returns falsy then an x-type of 'x' will be used.

# axis.annotationYType([type])
If type is specified, sets the annotation-y-type accessor to the specified accessor function and returns the axis chart generator. If type is not specified, returns the current annotation-y-type accessor, which defaults to:
function (d) {
  return d.yType;
}

The annotation's y-type should be either 'y' or 'y2'. If the accessor returns falsy then an y-type of 'y' will be used.

# axis.annotationZ([z])
If z is specified, sets the the annotation-z accessor function and returns the axis chart generator. If z is not specified, returns the current annotation-z accessor, which defaults to:
function (d) {
  return d.z;
}

The annotation's z value should be either 'front' or 'back'. If the accessor returns falsy then it will default to 'front'.

# axis.annotationX([x])
If x is specified, sets the the annotation-x accessor function and returns the axis chart generator. If x is not specified, returns the current annotation-x accessor, which defaults to:
function (d) {
  return d.x;
}

The x value should be represented in the data space. This is different from using d3.annotation directly where you would indicate x as a visual pixel value.

# axis.annotationY([y])
If y is specified, sets the the annotation-y accessor function and returns the axis chart generator. If y is not specified, returns the current annotation-y accessor, which defaults to:
function (d) {
  return d.y;
}

The y value should be represented in the data space. This is different from using d3.annotation directly where you would indicate y as a visual pixel value.

# axis.annotationX2([x2])
If x2 is specified, sets the the annotation-x2 accessor function and returns the axis chart generator. If x2 is not specified, returns the current annotation-x2 accessor, which defaults to:
function (d) {
  return d.x2;
}

The x2 value is only used when rendering a horizontal d3.annotationXYThreshold or d3.annotationCallourRect. This value will be used to automatically generate the threshold endpoints or rectangle width.

# axis.annotationY2([y2])
If y2 is specified, sets the the annotation-y2 accessor function and returns the axis chart generator. If y2 is not specified, returns the current annotation-y2 accessor, which defaults to:
function (d) {
  return d.y2;
}

The y2 value is only used when rendering a vertical d3.annotationXYThreshold or d3.annotationCallourRect. This value will be used to automatically generate the threshold endpoints or rectangle height.

# axis.annotationColor([color])
If color is specified, sets the the annotation-color accessor function and returns the axis chart generator. If color is not specified, returns the current annotation-color accessor, which defaults to:
function (d) {
  return d.color;
}

In the case of a axis chart annotation the default color will be 'steelblue'. In the case of a graph annotation the color will default to the graph's color.

charts/pie.html.body:
d2b › Chart Pie



# d2b.chartPie()
Constructs a new pie chart generator with the default settings.
When using the d2b-pie generator you can draw a pie chart onto each element in the selection.

# pie(context)
Render the pie chart(s) to the given context, which may be either a d3-selection of html containers (e.g. div) or a corresponding d3-transition.
Before applying the d2b-pie-chart generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var pie = d2b.chartPie().donutRatio(0.5);

pie.chartFrame().size({height: 400});

var chart = d3.select('.pie-chart');

chart
    .datum([
      {label: 'arc 1', value: 23, empty: true},
      {label: 'arc 2', value: 31},
      {label: 'arc 3', value: 80},
      {label: 'arc 4', value: 8}
    ])
  .transition()
    .call(pie);


# pie.chartFrame([chartFrame])
If chartFrame is specified, sets the chartFrame generator to the specified d2b.chartFrame and returns the pie-chart generator. If chartFrame is not specified, returns the current chartFrame generator, which defaults to d2b.chartFrame().legendEnabled(true).breadcrumbsEnabled(false).
The chartFrame can be configured at will.

# pie.legend([legend])
If legend is specified, sets the legend generator to the specified d2b.legend and returns the pie-chart generator. If legend is not specified, returns the current legend generator, which defaults to d2b.legend().clickable(true).dblclickable(true).
The legend can be configured at will, except for the html, color, key, and values properties which will be set automatically by the pie-chart.

# pie.tooltip([tooltip])
If tooltip is specified, sets the tooltip generator to the specified d2b.tooltip and returns the pie-chart generator. If tooltip is not specified, returns the current tooltip generator, which defaults to:
  const percent = d3.format('.0%');
  d2b.tooltip()
    .followMouse(true)
    .html(d => `${pie.label()(d.data)}: ${pie.value()(d.data)} (${percent(d.__percent__)})`)

The tooltip can be configured at will, except for the color property which will be set automatically by the pie-chart.

# pie.pie([d2b-pie])
If d2b-pie is specified, sets the d2b-pie generator to the specified d2b.svgPie and returns the pie-chart generator. If d2b-pie is not specified, returns the current d2b-pie generator, which defaults to () => d2b.svgPie().
The d2b-pie generator can be configured at will, except for the value, color, key, and values properties which will be set automatically by the pie-chart.
Datum Level Accessors
When the d2b pie-chart generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d.

# pie.duration([duration])
If duration is specified, sets the duration of the internal chart transitions to the specified accessor function or value and returns the pie-chart generator. If duration is not specified, returns the current duration accessor, which defaults to () => 250.

# pie.donutRatio([donutRatio])
If donutRatio is specified, sets the donutRatio to the specified accessor function or value and returns the pie-chart generator. If donutRatio is not specified, returns the current donutRatio accessor, which defaults to () => 0.

# pie.radius([radius])
If radius is specified, sets the pie-chart radius to the specified accessor function or value in pixels and returns the pie-chart generator. If radius is not specified, returns the current radius accessor, which defaults to:
function (d, w, h) {
  return Math.min(w, h) / 2;
}

In addition to the element datum d, the radius accessor function is also provided with the chart width w and height h.

# pie.at([at])
If at is specified, sets the pie-chart "at" location description to the specified accessor function, object, or string and returns the pie-chart generator. If at is not specified, returns the current at accessor, which defaults to () => 'center center'.
If at is a string it should be formatted like 'top left', 'at right', ..  To describe where the pie chart should fit within its frame.
If at is an object it should be formatted like {x : w / 2, y: h / 2}, where the x and y coordinates position the center of the pie chart within its frame.
In addition to the element datum d, the at accessor function is also provided with the chart width w and height h, as well as the pie radius r. These could be used to dynamically position the pie-chart like in the example below:
function (d, w, h, r) {
  return { x: w / 2, y: h / 2 };
}


# pie.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the pie-chart generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d;
}

Value Level Accessors
When the d2b pie-chart generator is applied to a selection, the following properties will be invoked for each element in the values array. The function will be passed the value data d.
function (d) {
  // d => {
  //   label: 'Apples',
  //   value: 120
  // }
}


# pie.value([value])
If value is specified, sets the value accessor to the specified accessor function and returns the pie-chart generator. If value is not specified, returns the current value accessor, which defaults to:
function (d) {
  return d.value;
}


# pie.color([color])
If color is specified, sets the color accessor to the specified accessor function and returns the pie-chart generator. If color is not specified, returns the current color accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(d.label);
}


# pie.key([key])
If key is specified, sets the key accessor to the specified accessor function and returns the pie-chart generator. If key is not specified, returns the current key accessor, which defaults to:
function (d) {
  return d.label;
}

If transitioning between data sets, the key may be used to be sure that the matching pie arcs transition properly.

# pie.label([label])
If label is specified, sets the label accessor to the specified accessor function and returns the pie-chart generator. If label is not specified, returns the current label accessor, which defaults to:
function (d) {
  return d.label;
}

Label is used to populate the legend and default tooltip contents.

charts/sunburst.html.body:
d2b › Chart Sunburst



# d2b.chartSunburst()
Constructs a new sunburst chart generator with the default settings.
When using the d2b-sunburst generator you can draw a sunburst chart onto each element in the selection.

# sunburst(context)
Render the sunburst chart(s) to the given context, which may be either a d3-selection of html containers (e.g. div) or a corresponding d3-transition.
Before applying the d2b-sunburst-chart generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var sunburst = d2b.chartSunburst();

sunburst.chartFrame().size({height: 500});

var chart = d3.select('.sunburst-chart');

chart
    .datum({
      label: 'root',
      children: [
        {
          label: 'child 1',
          children: [
            {
              label: 'child 1-1',
              size: 10
            },
            {
              label: 'child 1-2',
              children: [
                {
                  label: 'child 1-2-1',
                  size: 5
                },
                {
                  label: 'child 1-3-1',
                  size: 8
                }
              ]
            },
            {
              label: 'child 1-3',
              selected: true,
              children: [
                {
                  label: 'child 1-3-1',
                  children: [
                    {
                      label: 'child 1-3-1-1',
                      size: 2
                    },
                    {
                      label: 'child 1-3-1-2',
                      size: 16
                    }
                  ]
                },
                {
                  label: 'child 1-3-2',
                  size: 8
                }
              ]
            }
          ]
        },
        {
          label: 'child 2',
          size: 25
        }
      ]
    })
  .transition()
    .call(sunburst);


# sunburst.chartFrame([chartFrame])
If chartFrame is specified, sets the chartFrame generator to the specified d2b.chartFrame and returns the sunburst-chart generator. If chartFrame is not specified, returns the current chartFrame generator, which defaults to d2b.chartFrame().legendEnabled(false).breadcrumbsEnabled(true).
The chartFrame can be configured at will.

# sunburst.breadcrumbs([breadcrumbs])
If breadcrumbs is specified, sets the breadcrumbs generator to the specified d2b.breadcrumbs and returns the sunburst-chart generator. If breadcrumbs is not specified, returns the current breadcrumbs generator, which defaults to:
const tipTemplate = function (d) {
  const percent = d.value / d.selected.value;
  const percentText = percent > 1 ?
    '' :
    `
      ${formatPercent(d.value / d.selected.value)}
    `;

  return `

      ${d.label}


      ${format(d.value)}
      ${percentText}

  `;
};

d2b.breadcrumbs()
  .html(d => `${tipTemplate(d)}`);

The breadcrumbs can be configured at will, except for the color and key properties which will be set automatically by the sunburst-chart.

# sunburst.tooltip([tooltip])
If tooltip is specified, sets the tooltip generator to the specified d2b.tooltip and returns the sunburst-chart generator. If tooltip is not specified, returns the current tooltip generator, which defaults to:
const tipTemplate = function (d) {
  const percent = d.value / d.selected.value;
  const percentText = percent > 1 ?
    '' :
    `
      ${formatPercent(d.value / d.selected.value)}
    `;

  return `

      ${d.label}


      ${format(d.value)}
      ${percentText}

  `;
};

d2b.tooltip()
  .followMouse(true)
  .html(d => `${tipTemplate(d)}`);

The tooltip can be configured at will, except for the color property which will be set automatically by the sunburst-chart.

# sunburst.sunburst([sunburst])
If sunburst is specified, sets the sunburst generator to the specified d2b.sunburst and returns the sunburst-chart generator. If sunburst is not specified, returns the current sunburst generator, which defaults to d2b.svgSunburst().
The sunburst can be configured at will, except for the color and label properties which will be set automatically by the sunburst-chart.
Datum Level Accessors
When the d2b sunburst-chart generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d.

# sunburst.outerRadius([outerRadius])
If outerRadius is specified, sets the sunburst-chart radius to the specified accessor function or value in pixels and returns the sunburst-chart generator. If outerRadius is not specified, returns the current outerRadius accessor, which defaults to:
function (d, w, h) {
  return Math.min(w, h) / 2;
}

In addition to the element datum d, the outerRadius accessor function is also provided with the chart width w and height h.

# sunburst.innerRadius([innerRadius])
If innerRadius is specified, sets the sunburst-chart radius to the specified accessor function or value in pixels and returns the sunburst-chart generator. If innerRadius is not specified, returns the current innerRadius accessor, which defaults to:
function (d, w, h) {
  return Math.min(50, Math.min(w, h) / 4);
}

In addition to the element datum d, the innerRadius accessor function is also provided with the chart width w and height h.
Value Level Accessors
When the d2b sunburst-chart generator is applied to a selection, the following properties will be invoked for each node in the hierarchy. The function will be passed the value data d as defined by the svg-sunburst.

# sunburst.label([label])
If label is specified, sets the label accessor to the specified accessor function and returns the sunburst generator. If label is not specified, returns the current label accessor, which defaults to:
function (d) {
  return d.label;
}


# sunburst.color([color])
If color is specified, sets the color accessor to the specified accessor function and returns the sunburst generator. If color is not specified, returns the current color accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(d.label);
}

svg/plane.html.body:
d2b › SVG Plane



# d2b.plane()
Constructs a new plane generator with the default settings.
The d2b-plane generator allows you to draw a 2D axis plane. The purpose of this generator is to take some of the complexity out of using raw d3 axes.

# plane(context)
Render the plane to the given context, which may be either a d3-selection of SVG containers (either SVG or G elements) or a corresponding d3-transition.
Before applying the d2b-plane generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var plane = d2b.plane();

var xAxis = d3.axisBottom(d3.scaleLinear()),
    yAxis = d3.axisLeft(d3.scaleLinear());

plane.size({width: 500, height: 300});

d3.select('body').append('svg')
    .datum({
      x: { axis: xAxis },
      y: { axis: yAxis }
    })
    .call(plane);

Datum Level Accessors
When the d2b-plane generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# plane.size([size])
If size is specified, sets the size-accessor to the specified function or object. If size is not specified, returns the current size-accessor. The points are sized by a pixel area value. The size will be the outer dimensions of the plane. If a null size is specified then a default size of { width: 960, height: 500 } will be used.

# plane.padding([padding])
If padding is specified, sets the padding-accessor to the specified function, value, or object. If padding is not specified, returns the current padding-accessor. If a null padding is specified then it will be computed dynamically based on the dimensions of the surrounding axes and labels.
The padding can be specified in the following formats:
  // If a value is given then this will be the padding on all sides of the
  // plane. (e.g. top, bottom, right, left will all be 0)
  plane.padding(0);
  // If an object is given then the padding for each side should be specified.
  plane.padding({ top: 10, bottom: 50, left: 50, right: 10 });
  // If null is given then the padding will be computed dynamically. this
  // is the default setting.
  plane.padding(null);

# plane.margin([margin])
If margin is specified, sets the margin-accessor to the specified function, value, or object. If margin is not specified, returns the current margin-accessor. The default margin-accessor is () => 0.
The margin can be specified in the following formats:
  // If a value is given then this will be the margin on all sides of the
  // plane. (e.g. top, bottom, right, left will all be 0)
  plane.margin(0);
  // If an object is given then the margin for each side should be specified.
  plane.margin({ top: 10, bottom: 50, left: 50, right: 10 });

# plane[axisType]([config])
If config is specified, sets the config-accessor to the specified function or object. If config is not specified, returns the current config-accessor. The default config-accessor is d => d[axisType].
If a falsy config is specified then this axis will not be rendered. The config uses the following format unless axis accessors are used to change this format. The following format example is for a plane.x configuration.
  {
    // Axis property is required if using an x-axis. This is also how the chosen
    // scale should be specified.

    axis: d3.axisBottom(d3.scaleLinear()),

    // Optional orient property can be used. Should be 'inner' or 'outer'.
    // Specifies whether the axis will be positioned on the inside of the plane
    // or outside of the plane. This should be paired with the d3-axis type.
    // E.g. if an x axis positioned on the inner bottom edge of the plane is
    // desired then axis: d3.axisTop() and orient: 'inner' should be used.

    // orient: 'outer',

    // Optional wrap length can be specified to indicate how many characters
    // should be allowed on each line before wrapping occurs.

    // wrapLength: 15,

    // Optional, tick size can be specified. The tick size defaults to 6 and
    // overrides the tickSize on the provided axis.

    // tickSize: 15,

    // Optional grid display can be toggled on or off for each axis. Defaults
    // to true.

    // showGrid: false,

    // Optional label can be specified.

    // label: 'Dollars',

    // Optional label orientation can be specified. Should be 2 words separated
    // by a space. Like 'inner start', 'outer end', 'inner middle', etc..

    // labelOrient: 'outer middle',

  }

# plane.x([x-config])
See plane[axisType].

# plane.y([y-config])
See plane[axisType].

# plane.x2([x2-config])
See plane[axisType].

# plane.y2([y2-config])
See plane[axisType].
Axis Level Accessors
When the d2b-plane generator is applied to a selection, the following properties will be invoked for each x, y, x2, or y2 axis that is specified. The function will be passed the axis data d and the index i of the plane element within the supplied selection or transition.

# plane.axis([axis])
If axis is specified, sets the axis-accessor to the specified function. If axis is not specified, returns the current axis-accessor, which defaults to d => d.axis.

# plane.orient([orient])
If orient is specified, sets the orient-accessor to the specified function or string. If orient is not specified, returns the current orient-accessor, which defaults to d => d.orient || 'outer'. The axis orient should be either inner or outer.

# plane.wrapLength([characters])
If characters is specified, sets the wrapLength-accessor to the specified function or value. If characters is not specified, returns the current wrapLength-accessor, which defaults to d => d.wrapLength || Infinity. The wrap length character count specifies how many characters should be allowed on each line for each tick of the axes.

# plane.tickSize([tickSize])
If tickSize is specified, sets the tickSize-accessor to the specified function or value. If tickSize is not specified, returns the current tickSize-accessor, which defaults to d => d.tickSize || 6. The axis tickSize replaces the d3-axis tickSize property which will be configured automatically based on the axis orientation and the specified tickSize.

# plane.showGrid([boolean])
If boolean is specified, sets the showGrid-accessor to the specified function or boolean. If boolean is not specified, returns the current showGrid-accessor, which defaults to d => d.showGrid === false. This boolean will decide whether the grid for this axis will be rendered or not.

# plane.label([label])
If label is specified, sets the label-accessor to the specified function. If label is not specified, returns the current label-accessor, which defaults to d => d.label. A falsy label will not be used.

# plane.labelOrient([orient])
If orient is specified, sets the label-orient-accessor to the specified function or string. If orient is not specified, returns the current label-orient-accessor, which defaults to d => d.labelOrient || 'outer middle'. The axis orient should be 2 words separated by a space. Like inner start, outer end, inner middle, etc..
Other Methods

# plane.box(context)
After the plane has been rendered you can retrieve the box for a single element d3 selection by using the plane.box(context) helper method. This box will allow you to judge the padding and dimensions of the inner plane. It will have the following format:
  {
    width: /* plane inner width */,
    height: /* plane inner height */,
    top: /* plane top spacing (padding + margin) */,
    bottom: /* plane bottom spacing (padding + margin) */,
    left: /* plane left spacing (padding + margin) */,
    right: /* plane right spacing (padding + margin) */,
  }

svg/area.html.body:
d2b › SVG Area



# d2b.svgArea()
Constructs a new area generator with the default settings. This is not the same as d3.area. The purpose of this module is to provide a common graph API used in other types of graphs (e.g. area, line, bar).
When using the d2b-area generator you can draw multiple area graphs onto each element in the selection. This is shown in the data example below.

# area(context)
Render the area(s) to the given context, which may be either a d3-selection of SVG containers (either SVG or G elements) or a corresponding d3-transition.
Before applying the d2b-area generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var area = d2b.svgArea();

var datum = [
  {
    label: 'Area Graph 1',
    values: [
      {x: 1, y: 18},
      {x: 2, y: 10},
      {x: 3, y: 26},
      {x: 4, y: 35},
      {x: 5, y: 14},
    ]
  },
  {
    label: 'Area Graph 2',
    values: [
      {x: 1, y: 13},
      {x: 2, y: 26},
      {x: 3, y: 41},
      {x: 4, y: 14},
      {x: 5, y: 36},
    ]
  }
];

d3.select('.chart')
    .datum(datum)
    .call(area);


# area.type()
Returns the string area.

# area.area([d3-area])
If d3-area is specified, sets the d3-area generator to the specified d3-area and returns the d2b area generator. If d3-area is not specified, returns the current d3-area generator, which defaults to d3.area().
The d3-area can be configured at will, except for the x and y properties which will be set automatically by the d2b area generator.

# area.stack([d3-stack])
If d3-stack is specified, sets the d3-stack generator to the specified d3-stack and returns the area generator. If d3-stack is not specified, returns the current d3-stack generator, which defaults to d3.stack().
The d3-stack can be configured at will, except for the keys and values properties which will be set automatically by the area generator.

# area.annotation([d3-annotation])
If d3-annotation is specified, sets the annotation generator to the specified d3-annotation and returns the area generator. If d3-annotation is not specified, returns the current annotation generator, which defaults to a d3.annotation().

# area.x([x])
If x is specified, sets the x scale to the specified d3-scale and returns the area generator. If x is not specified, returns the current x scale, which defaults to a d3.scaleLinear().

# area.y([y])
If y is specified, sets the y scale to the specified d3-scale and returns the area generator. If y is not specified, returns the current y scale, which defaults to a d3.scaleLinear().
Datum Level Accessors
When the d2b area generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# area.graphs([graphs])
If graphs is specified, sets the graphs array to the specified accessor function or array and returns the area generator. If graphs is not specified, returns the current graphs accessor, which defaults to d => d.
Graph Level Accessors
When the d2b area generator is applied to a selection, the following properties will be invoked for each graph in the graphs array. The function will be passed the graph data d and the corresponding graph index i.
function (d) {
  // Here is what d might contain
  // d => {
  //   label: 'Area Graph 1',
  //   values: [
  //     {x: 1, y: 18},
  //     {x: 2, y: 10},
  //     {x: 3, y: 26},
  //     {x: 4, y: 35},
  //     {x: 5, y: 14},
  //   ]
  // }
}


# area.tooltipGraph([tooltip_graph])
If tooltip_graph is specified, sets the tooltip_graph to the specified accessor function and returns the area generator. If tooltip_graph is not specified, returns the current tooltip_graph accessor, which defaults to:
  function (d) {
    return d.tooltipGraph;
  }


# area.shift([shift])
If shift is specified, sets the horizontal shift to the specified accessor function or value and returns the area generator. If shift is not specified, returns the current shift accessor, which defaults to () => null.
If a null accessor is used this shift will be computed dynamically based on the type of d3-scale being used. If a band scale is used then the shift will be set to half of the scales bandwidth.

# area.stackBy([stack_by])
If stack_by is specified, sets the stack_by accessor to the specified accessor function and returns the area generator. If stack_by is not specified, returns the current stack_by accessor, which defaults to () => null.
If the accessor returns falsy then no graph stacking will be performed. If the accessor returns truthy then all graphs in a datum set will be stacked together. A more advanced method of stacking allows to stack specific graphs together, this can be done by using a stack property on the graph and setting the stackBy accessor accordingly. In the example below there will be two graphs stacked together under the key 1, two graphs stacked together under the key 2, and one other graph that is denoted as stack 3.
area.stackBy(function (d) {
  return d.stack;
});

data = {
  graphs: [
    {
      label: 'Area Graph 1',
      stack: 1,
      values: []
    },
    {
      label: 'Area Graph 2',
      stack: 1,
      values: []
    },
    {
      label: 'Area Graph 3',
      stack: 2,
      values: []
    },
    {
      label: 'Area Graph 4',
      stack: 2,
      values: []
    },
    {
      label: 'Area Graph 5',
      stack: 3,
      values: []
    }
  ]
}


# area.key([key])
If key is specified, sets the graph key accessor to the specified accessor function and returns the area generator. If key is not specified, returns the current key accessor, which defaults to (d) => d.label.
If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# area.color([color])
If color is specified, sets the color accessor to the specified accessor function and returns the area generator. If color is not specified, returns the current color accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(d.label);
}

If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# area.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the area generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d.values;
}

Value Level Accessors
When the d2b area generator is applied to a selection, the following properties will be invoked for each element in the values array. The function will be passed the value data d and the index position within the values array i.
function (d, i) {
  // d => {
  //   x: 1,
  //   y: 18
  // }
}


# area.px([px])
If px is specified, sets the px accessor to the specified accessor function and returns the area generator. If px is not specified, returns the current px accessor, which defaults to:
function (d) {
  return d.x;
}


# area.py([py])
If py is specified, sets the py accessor to the specified accessor function and returns the area generator. If py is not specified, returns the current py accessor, which defaults to:
function (d) {
  return d.y;
}


# area.py0([py0])
If py0 is specified, sets the py0 accessor to the specified accessor function and returns the area generator. If py0 is not specified, returns the current py0 accessor, which defaults to:
function (d) {
  return null;
}

Note: When a null y0 is used it will default to 0. Also, when stacking is applied y0 is ignored.

# area.pannotations([annotations])
If annotations is specified, sets the annotations accessor to the specified accessor function and returns the area generator. If annotations is not specified, returns the current annotations accessor, which defaults to:
function (d) {
  return d.annotations;
}


# area.pkey([key])
If key is specified, sets the key accessor to the specified accessor function and returns the area generator. If key is not specified, returns the current key accessor, which defaults to (d, i) => i.
Because the area generator does not render discrete points, this will only be used in rendering annotations.

# area.pcolor([color])
If color is specified, sets the color accessor to the specified accessor function and returns the area generator. If color is not specified, returns the current color accessor, which defaults to () => null.
If color is null then the corresponding graph color will be used. Because the area generator does not render discrete points, this will only be used in rendering annotations.
Annotations 
The area graph generator has built in hooks for annotations using the d3.annotation plugin. Each value in an area graph may contain an annotation at its y0 and y1 locations. For example, an area value with two annotations:
{
  x: 2,
  y: 41,
  annotations: [
    {
      // area value location y0 or y1
      location: 'y0',
      // dx/dy pixel offset that the annotation has from the value
      dy: -150,
      dx: -150,
      // use a custom annotation type from d3.annotation
      type: d3.annotationCalloutCircle,
      note: {
        title: 'Important Point at Y0'
      },
      subject: {
        radius: 20,
        radiusPadding: 5
      },
      connector: {
        end : "arrow"
      }
    },
    {
      // these are the minimum attributes that can be given for an annotation
      location: 'y1',
      dy: -60,
      dx: 0,
      note: {
        title: 'Important Point at Y1'
      },
    }
  ]
}

Other Methods

# area.getComputedGraphs(context)
Returns the array of computed graphs for the context's datum. This is not the same as the graphs array provided in the datum. This is a constructed graphs array that invokes all of the accessors described above. Usually this is used internally by the d2b.chartAxis module.

# area.getVisiblePoints(context)
Returns the array of visible points. This array will be formed by concatenating all of the graph values and invoking the px and py accessor for each. Each value will have two elements from this visible points array, one for the discrete point's y0 and one for y1. This is helpful when trying to dynamically update the scale domains based on the range of x and y values. Usually this is used internally by the d2b.chartAxis module.
The returned array will look something like this:
[
  {x: 1, y: 0, graph: {/*graph object*/}},
  {x: 1, y: 18, graph: {/*graph object*/}},
  // ...
]

