svg/box_plot.html.body:
d2b › SVG Box Plot



# d2b.svgBoxPlot()
Constructs a new box-plot generator with the default settings. The purpose of this module is to provide a common graph API used in other types of graphs (e.g. box-plot, line, area).
When using the d2b-box-plot generator you can draw multiple box-plot graphs onto each element in the selection. This is shown in the data example below.

# boxPlot(context)
Render the box-plot(s) to the given context, which may be either a d3-selection of SVG containers (either SVG or G elements) or a corresponding d3-transition.
Before applying the d2b-box-plot generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var boxPlot = d2b.svgBoxPlot();

var datum = [
  {
    label: 'Box Plot 1',
    values: [
      {
        x: 1,
        maximum: 10,   
        minimum: 1,   
        upperQuartile: 7.5,   
        lowerQuartile: 2.8,
        median: 5.4,
        outliers: [0.5, 12, 13.3]
      },
      {
        x: 2,
        maximum: 12,   
        minimum: 3,   
        upperQuartile: 9,     
        lowerQuartile: 5.8,
        median: 7
      },
      {
        x: 3,
        maximum: 15,   
        minimum: 4.5,
        upperQuartile: 12.8,  
        lowerQuartile: 6.2,
        median: 7.3
      }
    ]
  },
  {
    label: 'Box Plot 2',
    values: [
      {
        x: 4,
        maximum: 6,    
        minimum: 0,   
        upperQuartile: 5,     
        lowerQuartile: 1.4,
        median: 3.8
      },
      {
        x: 5,
        maximum: 8.2,  
        minimum: 1.2,
        upperQuartile: 7,     
        lowerQuartile: 2.8,
        median: 5.5,
        outliers: [1, 11.1, 14.5]
      },
      {
        x: 6,
        maximum: 12.8,
        minimum: 4.2,
        upperQuartile: 11,    
        lowerQuartile: 4.8,
        median: 6.4
      }
    ]
  }
];

d3.select('.chart')
    .datum(datum)
    .call(boxPlot);


# boxPlot.type()
Returns the string boxPlot.

# boxPlot.x([x])
If x is specified, sets the x scale to the specified d3-scale and returns the box-plot generator. If x is not specified, returns the current x scale, which defaults to d3.scaleLinear().

# boxPlot.y([y])
If y is specified, sets the y scale to the specified d3-scale and returns the box-plot generator. If y is not specified, returns the current y scale, which defaults to d3.scaleLinear().

# boxPlot.box([box])
If box is specified, sets the box scale to the specified d2b-box and returns the box generator. If box is not specified, returns the current box, which defaults to d2b.svgBox().
Box can be configured at will except for the scale, enterScale, orient, data, and color props, which will be set automatically by the box-plot generator.

# boxPlot.annotation([d3-annotation])
If d3-annotation is specified, sets the annotation generator to the specified d3-annotation and returns the boxPlot generator. If d3-annotation is not specified, returns the current annotation generator, which defaults to a d3.annotation().
Datum Level Accessors
When the d2b box-plot generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# boxPlot.graphs([graphs])
If graphs is specified, sets the graphs array to the specified accessor function or array and returns the box-plot generator. If graphs is not specified, returns the current graphs accessor, which defaults to d => d.
Graph Level Accessors
When the d2b box-plot generator is applied to a selection, the following properties will be invoked for each graph in the graphs array. The function will be passed the graph data d and the corresponding graph index i.
function (d) {
  // Here is what d might contain
  // d => {
  //   x: 1,
  //   maximum: 10,   
  //   minimum: 1,   
  //   upperQuartile: 7.5,   
  //   lowerQuartile: 2.8,
  //   median: 5.4,
  //   outliers: [0.5, 12, 13.3]
  // },
  // {
  //   x: 2,
  //   maximum: 12,   
  //   minimum: 3,   
  //   upperQuartile: 9,     
  //   lowerQuartile: 5.8,
  //   median: 7
  // },
  // {
  //   x: 3,
  //   maximum: 15,   
  //   minimum: 4.5,
  //   upperQuartile: 12.8,  
  //   lowerQuartile: 6.2,
  //   median: 7.3
  // }
}


# boxPlot.tooltipGraph([tooltip_graph])
If tooltip_graph is specified, sets the tooltip_graph to the specified accessor function and returns the box-plot generator. If tooltip_graph is not specified, returns the current tooltip_graph accessor, which defaults to:
  function (d) {
    return d.tooltipGraph;
  }


# boxPlot.shift([shift])
If shift is specified, sets the horizontal shift to the specified accessor function or value and returns the box-plot generator. If shift is not specified, returns the current shift accessor, which defaults to () => null.
If a null accessor is used this shift will be computed dynamically based on the type of d3-scale being used. If a band scale is used then the shift will be set to half of the scales bandwidth.

# boxPlot.key([key])
If key is specified, sets the graph key to the specified function and returns the box-plot generator. If key is not specified, returns the current key accessor, which defaults to (d) => d.label.
If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# boxPlot.color([color])
If color is specified, sets the color accessor to the specified function or string and returns the box-plot generator. If color is not specified, returns the current color accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(d.label);
}

If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# box.orient([orientation])
If orientation is specified, sets the box-plot-orientation to the specified function or string. If orientation is not specified, returns the current box-plot-orientation accessor function, which defaults to 'vertical'. The orientation should be one of 'vertical' or 'horizontal'.

# boxPlot.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the box-plot generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d.values;
}

Value Level Accessors
When the d2b box-plot generator is applied to a selection, the following properties will be invoked for each element in the values array. The function will be passed the value data d and the index position within the values array i.
function (d) {
  // Here is what d might contain
  // d => {
  //   x: 1,
  //   maximum: 10,   
  //   minimum: 1,   
  //   upperQuartile: 7.5,   
  //   lowerQuartile: 2.8,
  //   median: 5.4,
  //   outliers: [0.5, 12, 13.3]
  // }
}


# boxPlot.px([px])
If px is specified, sets the px accessor to the specified accessor function and returns the box-plot generator. If px is not specified, returns the current px accessor, which defaults to:
function (d) {
  return d.x;
}

Note: In the case of a 'horizontal' orient, the invoked x value will not be used.

# boxPlot.py([py])
If py is specified, sets the py accessor to the specified accessor function and returns the box-plot generator. If py is not specified, returns the current py accessor, which defaults to:
function (d) {
  return d.y;
}

Note: In the case of a 'vertical' orient, the invoked x value will not be used.

# boxPlot.pcolor([color])
If color is specified, sets the color accessor to the specified accessor function and returns the box-plot generator. If color is not specified, returns the current color accessor, which defaults to () => null.
If color is null then the corresponding graph color will be used.

# boxPlot.pkey([key])
If key is specified, sets the key accessor to the specified accessor function and returns the box-plot generator. If key is not specified, returns the current key accessor, which defaults to (d, i) => i.
If transitioning between data sets, the key may be used to be sure that the matching box-plot points transition properly.

# boxPlot.pannotations([annotations])
If annotations is specified, sets the annotations accessor to the specified accessor function and returns the boxPlot generator. If annotations is not specified, returns the current annotations accessor, which defaults to:
function (d) {
  return d.annotations;
}

Annotations 
The box plot generator has built in hooks for annotations using the d3.annotation plugin. Each box in an box plot may contain an annotation at its maximum, upperQuartile, median, lowerQuartile, and minimum locations. For example, a box with annotations at the upper and lower quartiles:
{
  x: 2,
  maximum: 15,
  minimum: 2,
  upperQuartile: 12,
  lowerQuartile: 4.8,
  median: 7,
  annotations: [
    {
      location: 'upperQuartile',
      dy: 0,
      dx: 60,
      note: {
        title: 'Upper Quartile'
      },
      connector: {
        end : "dot"
      }
    },
    {
      location: 'lowerQuartile',
      dy: 0,
      dx: 60,
      note: {
        title: 'Lower Quartile'
      },
      connector: {
        end : "dot"
      }
    }
  ]
}

Other Methods

# boxPlot.getComputedGraphs(context)
Returns the array of computed graphs for the context's datum. This is not the same as the graphs array provided in the datum. This is a constructed graphs array that invokes all of the accessors described above. Usually this is used internally by the d2b.chartAxis module.

# boxPlot.getVisiblePoints(context)
Returns the array of visible points. This array will be formed by concatenating all of the graph values and invoking the px and py accessor for each. This is helpful when trying to dynamically update the scale domains based on the range of x and y values. Usually this is used internally by the d2b.chartAxis module.

svg/bubble_pack.html.body:
d2b › SVG BubblePack



# d2b.svgBubblePack()
Constructs a new bubblePack generator with the default settings. The purpose of this module is to provide a common graph API used in other types of graphs (e.g. area, line, bar).
When using the d2b-bubblePack generator you can draw multiple bubblePack graphs onto each element in the selection. This is shown in the data example below.

# bubblePack(context)
Render the bubblePack(s) to the given context, which may be either a d3-selection of SVG containers (either SVG or G elements) or a corresponding d3-transition.
Before applying the d2b-bubblePack generator, you should join the data to the selected element(s) using selection.data or selection.datum. The data format is different than other d2b graph generators because it is hierarchical. Here is the default data format.
var bubblePack = d2b.svgBubblePack();

var datum = [
  {
    label: 'Bubble Pack Graph 1',
    values: [
      {
        label: 'Parent 1',
        // By setting expanded to true, this bubble will initially be expanded
        // expanded: true,
        children: [
          {
            label: 'Parent 1 Child 1',
            children: [
              {
                label: 'Parent 1 Child 1 Child 1',
                size: 20,
                x: 15,
                y: 25
              },
              {
                label: 'Parent 1 Child 1 Child 2',
                size: 4,
                x: 34,
                y: 14
              }
            ]
          },
          {
            label: 'Parent 1 Child 2',
            size: 10,
            x: 25,
            y: 14
          }
        ],
      },
      {
        label: 'Parent 2',
        size: 10,
        x: 31,
        y: 45
      }
    ]
  },
  {
    label: 'Bubble Pack Graph 2',
    values: [
      {
        label: 'Parent 1',
        size: 22,
        x: 4,
        y: 50
      }
    ]
  }
];

d3.select('.chart')
    .datum(datum)
    .call(bubblePack);

The leaf nodes of the data should contain size, x, and y values.
Expanding Bubbles
By default if a node has an array of children then it can be "expanded". When the user clicks on a bubble the bubble will disappear and the children bubbles will transition to their respective locations. This can also be done programmatically by setting the expanded flag on a node in the hierarchy.

# bubblePack.type()
Returns the string bubblePack.

# bubblePack.point([point])
If point is specified, sets the point generator to the specified point and returns the bubblePack generator. If point is not specified, returns the current point generator, which defaults to:
  var point = d2b.point().size(d => d.size * 100);

  function () {
    return point;
  }

The point can be configured at will, except for the active, fill, and type properties which will be set automatically by the bubblePack generator.

# bubblePack.x([x])
If x is specified, sets the x scale to the specified d3-scale and returns the bubblePack generator. If x is not specified, returns the current x scale, which defaults to a d3.scaleLinear().
Currently, only continuous scales are supported for the bubble pack.

# bubblePack.y([y])
If y is specified, sets the y scale to the specified d3-scale and returns the bubblePack generator. If y is not specified, returns the current y scale, which defaults to a d3.scaleLinear().
Currently, only continuous scales are supported for the bubble pack.

# bubblePack.annotation([d3-annotation])
If d3-annotation is specified, sets the annotation generator to the specified d3-annotation and returns the bubblePack generator. If d3-annotation is not specified, returns the current annotation generator, which defaults to a d3.annotation().
Datum Level Accessors
When the d2b bubblePack generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# bubblePack.graphs([graphs])
If graphs is specified, sets the graphs array to the specified accessor function or array and returns the bubblePack generator. If graphs is not specified, returns the current graphs accessor, which defaults to d => d.

# bubblePack.duration([duration])
If duration is specified, sets the duration of the internal chart transitions to the specified accessor function or value and returns the bubblePack generator. If duration is not specified, returns the current duration accessor, which defaults to () => 250.
Graph Level Accessors
When the d2b bubblePack generator is applied to a selection, the following properties will be invoked for each graph in the graphs array. The function will be passed the graph data d and the corresponding graph index i.
function (d) {
  // Here is what d might contain
  // d => {
  //   label: 'Bubble Pack Graph 2',
  //   values: [
  //     {
  //       label: 'Parent 1',
  //       size: 22,
  //       x: 4,
  //       y: 50
  //     }
  //   ]
  // }
}


# bubblePack.tendancy([tendancy])
If tendancy is specified, sets the tendancy to the specified accessor function or d2b math tendancy  (e.g. d2b.mean, d2b.median) and returns the bubblePack generator. If tendancy is not specified, returns the current tendancy scale accessor, which defaults to:
function () {
  return d2b.mean;
}


# bubblePack.tooltipGraph([tooltip_graph])
If tooltip_graph is specified, sets the tooltip_graph to the specified accessor function and returns the bubblePack generator. If tooltip_graph is not specified, returns the current tooltip_graph accessor, which defaults to:
  function (d) {
    return d.tooltipGraph;
  }


# bubblePack.shift([shift])
If shift is specified, sets the horizontal shift to the specified accessor function or value and returns the bubblePack generator. If shift is not specified, returns the current shift accessor, which defaults to () => null.
If a null accessor is used this shift will be computed dynamically based on the type of d3-scale being used. If a band scale is used then the shift will be set to half of the scale's bandwidth.

# bubblePack.symbol([symbol])
If symbol is specified, sets the graph symbol accessor to the specified accessor function and returns the bubblePack generator. If symbol is not specified, returns the current symbol accessor, which defaults to (d) => d3.symbolCircle.
This property should be set to one of the preset or custom d3 symbols. This symbol type will set the default symbol type for an entire graph.

# bubblePack.key([key])
If key is specified, sets the graph key accessor to the specified accessor function and returns the bubblePack generator. If key is not specified, returns the current key accessor, which defaults to (d) => d.label.
If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# bubblePack.color([color])
If color is specified, sets the color accessor to the specified accessor function and returns the bubblePack generator. If color is not specified, returns the current color accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(d.label);
}

If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# bubblePack.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the bubblePack generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d.values;
}

Value Level Accessors
When the d2b bubblePack generator is applied to a selection, the hierarchical value data will be flattened and the following accessors will invoked for each node in the flattened array. The function will be passed the value data d, the index position within it's values or children array i, and the corresponding graph data graph.
Note that not every accessor will be invoked for all nodes in the hierarchy, sometimes the "hidden" nodes won't need certain properties to be processed.
function (d, i, graph) {
  // An example of the node data being passed to the accessor function
  // d => {
  //   label: 'Parent 1 Child 1',
  //   children: [
  //     {
  //       label: 'Parent 1 Child 1 Child 1',
  //       size: 20,
  //       x: 15,
  //       y: 25
  //     },
  //     {
  //       label: 'Parent 1 Child 1 Child 2',
  //       size: 4,
  //       x: 34,
  //       y: 14
  //     }
  //   ]
  // }
}


# bubblePack.px([px])
If px is specified, sets the px accessor to the specified accessor function and returns the bubblePack generator. If px is not specified, returns the current px accessor, which defaults to:
function (d) {
  return d.x;
}


# bubblePack.py([py])
If py is specified, sets the py accessor to the specified accessor function and returns the bubblePack generator. If py is not specified, returns the current py accessor, which defaults to:
function (d) {
  return d.y;
}


# bubblePack.pcolor([color])
If color is specified, sets the color accessor to the specified accessor function and returns the bubblePack generator. If color is not specified, returns the current color accessor, which defaults to () => null.
If color is null then the corresponding graph color will be used.

# bubblePack.psymbol([symbol])
If symbol is specified, sets the symbol accessor to the specified accessor function and returns the bubblePack generator. If symbol is not specified, returns the current symbol accessor, which defaults to () => null.
If symbol is null then the corresponding graph symbol type will be used.

# bubblePack.psize([size])
If size is specified, sets the size accessor to the specified accessor function and returns the bubblePack generator. If size is not specified, returns the current size accessor, which defaults to:
function (d) {
  return d.size;
}

The size is a numerical value corresponding to the pixel area of the defined symbol type.

# bubblePack.pkey([key])
If key is specified, sets the key accessor to the specified accessor function and returns the bubblePack generator. If key is not specified, returns the current key accessor, which defaults to (d, i) => i.
If transitioning between data sets, the key may be used to be sure that the matching bubblePack points transition properly.

# bubblePack.pannotation([annotation])
If annotation is specified, sets the annotation accessor to the specified accessor function and returns the bubblePack generator. If annotation is not specified, returns the current annotation accessor, which defaults to:
function (d) {
  return d.annotation;
}

Annotations 
The bubblePack graph generator has built in hooks for annotations using the d3.annotation plugin. Each value in a bubblePack graph may contain an annotation at its (x, y) location. For example, a bubble value with an annotation:
{
  label: 'A Leaf Bubble',
  x: 2,
  y: 41,
  size: 5,
  annotation: {
    // dx/dy pixel offset that the annotation has from the value
    dy: -150,
    dx: -150,
    // use a custom annotation type from d3.annotation
    type: d3.annotationCalloutCircle,
    note: {
      title: 'Important Point'
    },
    subject: {
      radius: 20,
      radiusPadding: 5
    },
    connector: {
      end : "arrow"
    }
  }
}

Other Methods

# bubblePack.getComputedGraphs(context)
Returns the array of computed graphs for the context's datum. This is not the same as the graphs array provided in the datum. This is a constructed graphs array that invokes all of the accessors described above. Usually this is used internally by the d2b.chartAxis module.

# bubblePack.getVisiblePoints(context)
Returns the array of visible points. This array will be formed by concatenating all of the graph values and invoking the px and py accessor for each. This is helpful when trying to dynamically update the scale domains based on the range of x and y values. Usually this is used internally by the d2b.chartAxis module.

svg/line.html.body:
d2b › SVG Line



# d2b.svgLine()
Constructs a new line generator with the default settings. This is not the same as d3.line. The purpose of this module is to provide a common graph API used in other types of graphs (e.g. line, area, bar).
When using the d2b-line generator you can draw multiple line graphs onto each element in the selection. This is shown in the data example below.

# line(context)
Render the line(s) to the given context, which may be either a d3-selection of SVG containers (either SVG or G elements) or a corresponding d3-transition.
Before applying the d2b-line generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var line = d2b.svgLine();

var datum = [
  {
    label: 'Line Graph 1',
    values: [
      {x: 1, y: 18},
      {x: 2, y: 10},
      {x: 3, y: 26},
      {x: 4, y: 35},
      {x: 5, y: 14},
    ]
  },
  {
    label: 'Line Graph 2',
    values: [
      {x: 1, y: 13},
      {x: 2, y: 26},
      {x: 3, y: 41},
      {x: 4, y: 14},
      {x: 5, y: 36},
    ]
  }
];

d3.select('.chart')
    .datum(datum)
    .call(line);


# line.type()
Returns the string line.

# line.line([d3-line])
If d3-line is specified, sets the d3-line generator to the specified d3-line and returns the d2b line generator. If d3-line is not specified, returns the current d3-line generator, which defaults to d3.line().
The d3-line can be configured at will, except for the x and y properties which will be set automatically by the d2b line generator.

# line.stack([d3-stack])
If d3-stack is specified, sets the d3-stack generator to the specified d3-stack and returns the line generator. If d3-stack is not specified, returns the current d3-stack generator, which defaults to d3.stack().
The d3-stack can be configured at will, except for the keys and values properties which will be set automatically by the line generator.

# line.annotation([d3-annotation])
If d3-annotation is specified, sets the annotation generator to the specified d3-annotation and returns the line generator. If d3-annotation is not specified, returns the current annotation generator, which defaults to a d3.annotation().

# line.x([x])
If x is specified, sets the x scale to the specified d3-scale and returns the line generator. If x is not specified, returns the current x scale, which defaults to a d3.scaleLinear().

# line.y([y])
If y is specified, sets the y scale to the specified d3-scale and returns the line generator. If y is not specified, returns the current y scale, which defaults to a d3.scaleLinear().
Datum Level Accessors
When the d2b line generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# line.graphs([graphs])
If graphs is specified, sets the graphs array to the specified accessor function or array and returns the line generator. If graphs is not specified, returns the current graphs accessor, which defaults to d => d.
Graph Level Accessors
When the d2b line generator is applied to a selection, the following properties will be invoked for each graph in the graphs array. The function will be passed the graph data d and the corresponding graph index i.
function (d) {
  // Here is what d might contain
  // d => {
  //   label: 'Line Graph 1',
  //   values: [
  //     {x: 1, y: 18},
  //     {x: 2, y: 10},
  //     {x: 3, y: 26},
  //     {x: 4, y: 35},
  //     {x: 5, y: 14},
  //   ]
  // }
}


# line.align([alignment])
If alignment is specified, sets the alignment to the specified accessor function or string (either "y0" or "y1") and returns the line generator. If alignment is not specified, returns the current alignment  accessor, which defaults to "y1".
If the stacking is used the alignment will decide to use the y0 values or y1 values from the stack to position each svg line.

# line.tooltipGraph([tooltip_graph])
If tooltip_graph is specified, sets the tooltip_graph to the specified accessor function and returns the line generator. If tooltip_graph is not specified, returns the current tooltip_graph accessor, which defaults to:
  function (d) {
    return d.tooltipGraph;
  }


# line.shift([shift])
If shift is specified, sets the horizontal shift to the specified accessor function or value and returns the line generator. If shift is not specified, returns the current shift accessor, which defaults to () => null.
If a null accessor is used this shift will be computed dynamically based on the type of d3-scale being used. If a band scale is used then the shift will be set to half of the scales bandwidth.

# line.stackBy([stack_by])
If stack_by is specified, sets the stack_by accessor to the specified accessor function and returns the line generator. If stack_by is not specified, returns the current stack_by accessor, which defaults to () => null.
If the accessor returns falsy then no graph stacking will be performed. If the accessor returns truthy then all graphs in a datum set will be stacked together. A more advanced method of stacking allows to stack specific graphs together, this can be done by using a stack property on the graph and setting the stackBy accessor accordingly. In the example below there will be two graphs stacked together under the key 1, two graphs stacked together under the key 2, and one other graph that is denoted as stack 3.
line.stackBy(function (d) {
  return d.stack;
});

data = {
  graphs: [
    {
      label: 'Line Graph 1',
      stack: 1,
      values: []
    },
    {
      label: 'Line Graph 2',
      stack: 1,
      values: []
    },
    {
      label: 'Line Graph 3',
      stack: 2,
      values: []
    },
    {
      label: 'Line Graph 4',
      stack: 2,
      values: []
    },
    {
      label: 'Line Graph 5',
      stack: 3,
      values: []
    }
  ]
}


# line.key([key])
If key is specified, sets the graph key accessor to the specified accessor function and returns the line generator. If key is not specified, returns the current key accessor, which defaults to (d) => d.label.
If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# line.color([color])
If color is specified, sets the color accessor to the specified accessor function and returns the line generator. If color is not specified, returns the current color accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(d.label);
}

If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# line.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the line generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d.values;
}

Value Level Accessors
When the d2b line generator is applied to a selection, the following properties will be invoked for each element in the values array. The function will be passed the value data d and the index position within the values array i.
function (d) {
  // d => {
  //   x: 1,
  //   y: 18
  // }
}


# line.px([px])
If px is specified, sets the px accessor to the specified accessor function and returns the line generator. If px is not specified, returns the current px accessor, which defaults to:
function (d) {
  return d.x;
}


# line.py([py])
If py is specified, sets the py accessor to the specified accessor function and returns the line generator. If py is not specified, returns the current py accessor, which defaults to:
function (d) {
  return d.y;
}


# area.pannotation([annotation])
If annotation is specified, sets the annotation accessor to the specified accessor function and returns the line generator. If annotation is not specified, returns the current annotation accessor, which defaults to:
function (d) {
  return d.annotation;
}


# line.pkey([key])
If key is specified, sets the key accessor to the specified accessor function and returns the line generator. If key is not specified, returns the current key accessor, which defaults to (d, i) => i.
Because the line generator does not render discrete points, this will only be used in rendering annotations.

# line.pcolor([color])
If color is specified, sets the color accessor to the specified accessor function and returns the line generator. If color is not specified, returns the current color accessor, which defaults to () => null.
If color is null then the corresponding graph color will be used. Because the line generator does not render discrete points, this will only be used in rendering annotations.
Annotations 
The line graph generator has built in hooks for annotations using the d3.annotation plugin. Each value in a line graph may contain an annotation at its (x, y) location. For example, a line value with an annotation:
{
  x: 2,
  y: 41,
  annotation: {
    // dx/dy pixel offset that the annotation has from the value
    dy: -150,
    dx: -150,
    // use a custom annotation type from d3.annotation
    type: d3.annotationCalloutCircle,
    note: {
      title: 'Important Point'
    },
    subject: {
      radius: 20,
      radiusPadding: 5
    },
    connector: {
      end : "arrow"
    }
  }
}

Other Methods

# line.getComputedGraphs(context)
Returns the array of computed graphs for the context's datum. This is not the same as the graphs array provided in the datum. This is a constructed graphs array that invokes all of the accessors described above. Usually this is used internally by the d2b.chartAxis module.

# line.getVisiblePoints(context)
Returns the array of visible points. This array will be formed by concatenating all of the graph values and invoking the px and py accessor for each. This is helpful when trying to dynamically update the scale domains based on the range of x and y values. Usually this is used internally by the d2b.chartAxis module.
The returned array will look something like this:
[
  {x: 1, y: 18, graph: {/*graph object*/}},
  {x: 2, y: 10, graph: {/*graph object*/}},
  // ...
]

svg/pie.html.body:
d2b › SVG Pie



# d2b.svgPie()
Constructs a new pie generator with the default settings. This is not the same as d3.pie, however it does use d3.pie internally.
When using the d2b-pie generator you can draw a pie onto each element in the selection.

# pie(context)
Render the pie(s) to the given context, which may be either a d3-selection of SVG containers (either SVG or G elements) or a corresponding d3-transition.
Before applying the d2b-pie generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var pie = d2b.svgPie();

pie.arc()
  .outerRadius(150)
  .innerRadius(100);

var data = [
    {label: 'Apples', value: 120},
    {label: 'Oranges', value: 101},
    {label: 'Grapes', value: 351}
];

var svg = d3.select('svg g')
    .datum(data)
    .call(pie);


# pie.arc([d3-arc])
If d3-arc is specified, sets the d3-arc generator to the specified d3-arc and returns the d2b-pie generator. If d3-arc is not specified, returns the current d3-arc generator, which defaults to d3.arc().
The d3-arc can be configured at will, except for the startAngle, endAngle, and padAngle properties which will be set automatically by the d2b-pie generator.

# pie.pie([d3-pie])
If d3-pie is specified, sets the d3-pie layout to the specified d3.pie and returns the d2b-pie generator. If d3-pie is not specified, returns the current d3-pie layout, which defaults to d3.pie().
The d3-pie can be configured at will, except for the value property which will be set automatically by the d2b-pie generator.
Datum Level Accessors
When the d2b pie generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# pie.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the pie generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d;
}

Value Level Accessors
When the d2b pie generator is applied to a selection, the following properties will be invoked for each element in the values array. The function will be passed the value data d and the index position within the values array i.
function (d, i) {
  // d => {
  //   label: 'Apples',
  //   value: 120
  // }
}


# pie.value([value])
If value is specified, sets the value accessor to the specified accessor function and returns the pie generator. If value is not specified, returns the current value accessor, which defaults to d => d.value.

# pie.color([color])
If color is specified, sets the color accessor to the specified accessor function and returns the pie generator. If color is not specified, returns the current color accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(d.label);
}


# pie.key([key])
If key is specified, sets the key accessor to the specified accessor function and returns the pie generator. If key is not specified, returns the current key accessor, which defaults to:
function (d) {
  return d.label;
}

If transitioning between data sets, the key may be used to be sure that the matching pie arcs transition properly.

svg/scatter.html.body:
d2b › SVG Scatter



# d2b.svgScatter()
Constructs a new scatter generator with the default settings. The purpose of this module is to provide a common graph API used in other types of graphs (e.g. scatter, line, bar).
When using the d2b-scatter generator you can draw multiple scatter graphs onto each element in the selection. This is shown in the data example below.

# scatter(context)
Render the scatter(s) to the given context, which may be either a d3-selection of SVG containers (either SVG or G elements) or a corresponding d3-transition.
Before applying the d2b-scatter generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var scatter = d2b.svgScatter();

var datum = [
  {
    label: 'Scatter Graph 1',
    values: [
      {x: 1, y: 18},
      {x: 2, y: 10},
      {x: 3, y: 26},
      {x: 4, y: 35},
      {x: 5, y: 14},
    ]
  },
  {
    label: 'Scatter Graph 2',
    values: [
      {x: 1, y: 13},
      {x: 2, y: 26},
      {x: 3, y: 41},
      {x: 4, y: 14},
      {x: 5, y: 36},
    ]
  }
];

d3.select('.chart')
    .datum(datum)
    .call(scatter);


# scatter.type()
Returns the string scatter.

# scatter.stack([d3-stack])
If d3-stack is specified, sets the d3-stack generator to the specified d3-stack and returns the scatter generator. If d3-stack is not specified, returns the current d3-stack generator, which defaults to d3.stack().
The d3-stack can be configured at will, except for the keys and values properties which will be set automatically by the scatter generator.
Usually scatter graphs are not stacked by themselves, but if they are used to overlay on a stacked area graph then stacking should be used to make sure they are aligned.

# scatter.annotation([d3-annotation])
If d3-annotation is specified, sets the annotation generator to the specified d3-annotation and returns the scatter generator. If d3-annotation is not specified, returns the current annotation generator, which defaults to a d3.annotation().

# scatter.x([x])
If x is specified, sets the x scale to the specified d3-scale and returns the scatter generator. If x is not specified, returns the current x scale, which defaults to a d3.scaleLinear().

# scatter.y([y])
If y is specified, sets the y scale to the specified d3-scale and returns the area generator. If y is not specified, returns the current y scale, which defaults to a d3.scaleLinear().
Datum Level Accessors
When the d2b scatter generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# scatter.graphs([graphs])
If graphs is specified, sets the graphs array to the specified accessor function or array and returns the scatter generator. If graphs is not specified, returns the current graphs accessor, which defaults to d => d.
Graph Level Accessors
When the d2b scatter generator is applied to a selection, the following properties will be invoked for each graph in the graphs array. The function will be passed the graph data d and the corresponding graph index i.
function (d) {
  // Here is what d might contain
  // d => {
  //   label: 'Scatter Graph 1',
  //   values: [
  //     {x: 1, y: 18},
  //     {x: 2, y: 10},
  //     {x: 3, y: 26},
  //     {x: 4, y: 35},
  //     {x: 5, y: 14},
  //   ]
  // }
}


# scatter.tooltipGraph([tooltip_graph])
If tooltip_graph is specified, sets the tooltip_graph to the specified accessor function and returns the scatter generator. If tooltip_graph is not specified, returns the current tooltip_graph accessor, which defaults to:
  function (d) {
    return d.tooltipGraph;
  }


# scatter.shift([shift])
If shift is specified, sets the horizontal shift to the specified accessor function or value and returns the scatter generator. If shift is not specified, returns the current shift accessor, which defaults to () => null.
If a null accessor is used this shift will be computed dynamically based on the type of d3-scale being used. If a band scale is used then the shift will be set to half of the scales bandwidth.

# scatter.stackBy([stack_by])
If stack_by is specified, sets the stack_by accessor to the specified accessor function and returns the scatter generator. If stack_by is not specified, returns the current stack_by accessor, which defaults to () => null.
If the accessor returns falsy then no graph stacking will be performed. If the accessor returns truthy then all graphs in a datum set will be stacked together. A more advanced method of stacking allows to stack specific graphs together, this can be done by using a stack property on the graph and setting the stackBy accessor accordingly. In the example below there will be two graphs stacked together under the key 1, two graphs stacked together under the key 2, and one other graph that is denoted as stack 3.
scatter.stackBy(function (d) {
  return d.stack;
});

data = {
  graphs: [
    {
      label: 'Scatter Graph 1',
      stack: 1,
      values: []
    },
    {
      label: 'Scatter Graph 2',
      stack: 1,
      values: []
    },
    {
      label: 'Scatter Graph 3',
      stack: 2,
      values: []
    },
    {
      label: 'Scatter Graph 4',
      stack: 2,
      values: []
    },
    {
      label: 'Scatter Graph 5',
      stack: 3,
      values: []
    }
  ]
}


# scatter.symbol([symbol])
If symbol is specified, sets the graph symbol accessor to the specified accessor function and returns the scatter generator. If symbol is not specified, returns the current symbol accessor, which defaults to (d) => d3.symbolCircle.
This property should be set to one of the preset or custom d3 symbols. This symbol type will set the default symbol type for an entire graph.

# scatter.key([key])
If key is specified, sets the graph key accessor to the specified accessor function and returns the scatter generator. If key is not specified, returns the current key accessor, which defaults to (d) => d.label.
If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# scatter.color([color])
If color is specified, sets the color accessor to the specified accessor function and returns the scatter generator. If color is not specified, returns the current color accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d) {
  return color(d.label);
}

If you are transitioning from one data set to another the key function is useful in making sure the proper graphs get updated to their corresponding values.

# scatter.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the scatter generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d.values;
}

Value Level Accessors
When the d2b scatter generator is applied to a selection, the following properties will be invoked for each element in the values array. The function will be passed the value data d and the index position within the values array i.
function (d) {
  // d => {
  //   x: 1,
  //   y: 18
  // }
}


# scatter.px([px])
If px is specified, sets the px accessor to the specified accessor function and returns the scatter generator. If px is not specified, returns the current px accessor, which defaults to:
function (d) {
  return d.x;
}


# scatter.py([py])
If py is specified, sets the py accessor to the specified accessor function and returns the scatter generator. If py is not specified, returns the current py accessor, which defaults to:
function (d) {
  return d.y;
}


# scatter.pcolor([color])
If color is specified, sets the color accessor to the specified accessor function and returns the scatter generator. If color is not specified, returns the current color accessor, which defaults to () => null.
If color is null then the corresponding graph color will be used.

# scatter.psymbol([symbol])
If symbol is specified, sets the symbol accessor to the specified accessor function and returns the scatter generator. If symbol is not specified, returns the current symbol accessor, which defaults to () => null.
If symbol is null then the corresponding graph symbol type will be used.

# scatter.psize([size])
If size is specified, sets the size accessor to the specified accessor function and returns the scatter generator. If size is not specified, returns the current size accessor, which defaults to () => 25. The size is a numerical value corresponding to the pixel area of the defined symbol type.

# scatter.pkey([key])
If key is specified, sets the key accessor to the specified accessor function and returns the scatter generator. If key is not specified, returns the current key accessor, which defaults to (d, i) => i.
If transitioning between data sets, the key may be used to be sure that the matching scatter points transition properly.

# scatter.pannotation([annotation])
If annotation is specified, sets the annotation accessor to the specified accessor function and returns the scatter generator. If annotation is not specified, returns the current annotation accessor, which defaults to:
function (d) {
  return d.annotation;
}

Annotations 
The scatter graph generator has built in hooks for annotations using the d3.annotation plugin. Each value in a scatter graph may contain an annotation at its (x, y) location. For example, a scatter value with an annotation:
{
  x: 2,
  y: 41,
  annotation: {
    // dx/dy pixel offset that the annotation has from the value
    dy: -150,
    dx: -150,
    // use a custom annotation type from d3.annotation
    type: d3.annotationCalloutCircle,
    note: {
      title: 'Important Point'
    },
    subject: {
      radius: 20,
      radiusPadding: 5
    },
    connector: {
      end : "arrow"
    }
  }
}

Other Methods

# scatter.getComputedGraphs(context)
Returns the array of computed graphs for the context's datum. This is not the same as the graphs array provided in the datum. This is a constructed graphs array that invokes all of the accessors described above. Usually this is used internally by the d2b.chartAxis module.

# scatter.getVisiblePoints(context)
Returns the array of visible points. This array will be formed by concatenating all of the graph values and invoking the px and py accessor for each. This is helpful when trying to dynamically update the scale domains based on the range of x and y values. Usually this is used internally by the d2b.chartAxis module.

svg/sankey.html.body:
d2b › SVG Sankey



# d2b.svgSankey()
Constructs a new sankey generator with the default settings.

# sankey(context)
Render the sankey(s) to the given context, which may be either a d3-selection of SVG containers (either SVG or G elements) or a corresponding d3-transition.
Before applying the d2b-sankey generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var sankey = d2b.svgSankey();


// use d3 to select the svg, set the datum, and apply the sankey generator
var svg = d3.select('svg g')
  .datum({
    nodes: [
      {name: 'Node A'},
      {name: 'Node B'},
      {name: 'Node C'},
      {name: 'Node D'},
      {name: 'Node E'},
    ],
    links: [
      {source: 'Node A', target: 'Node E', value: 2},
      {source: 'Node A', target: 'Node C', value: 2},
      {source: 'Node B', target: 'Node C', value: 2},
      {source: 'Node B', target: 'Node D', value: 2},
      {source: 'Node C', target: 'Node D', value: 2},
      {source: 'Node C', target: 'Node E', value: 2},
      {source: 'Node D', target: 'Node E', value: 4},
    ]
  })
  .call(sankey);


# sankey.sankey([d3-sankey])
If d3-sankey is specified, sets the d3-sankey generator to the specified d3-sankey and returns the sankey generator. If d3-sankey is not specified, returns the current d3-sankey generator, which defaults to d3.sankey().
The d3-sankey can be configured at will, except for the size, nodeId, nodes, and links properties which will be set automatically by the sankey generator.
Datum Level Accessors
When the d2b sankey generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d.

# sankey.size([size])
If size is specified, sets the size-accessor to the specified function or object. If size is not specified, returns the current duration-accessor, which defaults to () => {width: 960, height: 500}.
The size will be used to propagate down to the d3.sankey size property, it should have a width and height attribute in pixels.

# sankey.nodes([nodes])
If nodes is specified, sets the nodes-accessor to the specified function or array. If nodes is not specified, returns the current nodes-accessor, which defaults to d => d.nodes.

# sankey.links([links])
If links is specified, sets the links-accessor to the specified function or array. If links is not specified, returns the current links-accessor, which defaults to d => d.links.
Node Level Accessors
When the d2b sankey generator is applied to a selection, the following properties will be invoked for each node in the nodes array. The function will be passed the node data d and the node index i.
function (d, i) {
  // Here is what d and i might contain
  // d => { name: 'Node A' }
  // i => 0
}


# sankey.nodeKey([key])
If key is specified, sets the node-key-accessor to the specified function. If key is not specified, returns the current node-key-accessor, which defaults to d => d.name.

# sankey.nodeLabel([label])
If label is specified, sets the node-label-accessor to the specified function. If label is not specified, returns the current node-label-accessor, which defaults to (d, i, key) => key.
Note: The node label accessor function received a third argument which is the determined nodeKey.

# sankey.nodeLabelWrapLength([label_wrap_length])
If wrap_length is specified, sets the node-label-wrap-length-accessor to the specified function or value in pixels. If wrap_length is not specified, returns the current node-label-wrap-length-accessor, which defaults to () => Infinity.

# sankey.nodeDraggableX([boolean])
If boolean is specified, sets the node-draggable-x-accessor to the specified function or bool. If boolean is not specified, returns the current node-draggable-x-accessor, which defaults to () => false.

# sankey.nodeDraggableY([boolean])
If boolean is specified, sets the node-draggable-y-accessor to the specified function or bool. If boolean is not specified, returns the current node-draggable-y-accessor, which defaults to () => false.

# sankey.nodePreserveDragging([boolean])
If boolean is specified, sets the node-preserve-dragging-accessor to the specified function or bool. If boolean is not specified, returns the current node-preserve-dragging-accessor, which defaults to () => true. If preserve dragging is enabled then every update the component will attempt to use the previous dragged to location for the sankey nodes.

# sankey.nodeColor([color])
If color is specified, sets the node-color-accessor to the specified function or color. If color is not specified, returns the current node-color-accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d, i, key) {
  return color(key);
}

Note: The node color accessor function received a third argument which is the determined nodeKey.
Link Level Accessors
When the d2b sankey generator is applied to a selection, the following properties will be invoked for each link in the links array. The function will be passed the link data d and the link index i.
function (d, i) {
  // Here is what d and i might contain
  // d => {source: 'Node A', target: 'Node E', value: 2}
  // i => 0
}


# sankey.linkSource([source])
If source is specified, sets the link-source-accessor to the specified function. If source is not specified, returns the current link-source-accessor, which defaults to d => d.source.

# sankey.linkSourceColor([color])
If color is specified, sets the link-source-color-accessor to the specified function or color. If color is not specified, returns the current link-source-color-accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d, i, sourceKey) {
  return color(sourceKey);
}

Note: The link source color accessor function received a third argument which is the determined source nodeKey.

# sankey.linkTarget([target])
If target is specified, sets the link-target-accessor to the specified function. If target is not specified, returns the current link-target-accessor, which defaults to d => d.target.

# sankey.linkTargetColor([color])
If color is specified, sets the link-target-color-accessor to the specified function or color. If color is not specified, returns the current link-target-color-accessor, which defaults to:
// define d3 color scale that will be used in the accessor
var color = d3.scaleOrdinal(d3.schemeCategory10);

function (d, i, targetKey) {
  return color(targetKey);
}

Note: The link source color accessor function received a third argument which is the determined source nodeKey.

# sankey.linkKey([key])
If key is specified, sets the link-key-accessor to the specified function. If key is not specified, returns the current link-key-accessor, which defaults to (d, i, sourceKey, targetKey) => `${sourceKey}-${targetKey}` .
Note: The link key accessor function received a third and fourth argument which are the determined source nodeKey and target nodeKey respectively.

# sankey.linkValue([value])
If value is specified, sets the link-value-accessor to the specified function or value. If value is not specified, returns the current link-value-accessor, which defaults to d => d.value.

utils/breadcrumbs.html.body:
d2b › Breadcrumbs


The d2b breadcrumbs component is used to render vertical or horizontal breadcrumbs.

# d2b.breadcrumbs()
Constructs a new breadcrumbs generator.

# breadcrumbs(context)
Render the breadcrumbs set(s) to the given context, which may be either a d3-selection of HTML containers (e.g. div) or a corresponding d3-transition.
Before applying the d2b-breadcrumbs generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var color = d3.scaleOrdinal(d3.schemeCategory10);
var breadcrumbs = d2b.breadcrumbs();

breadcrumbs
  .vertical(false)
  .color(function (d, i) { return color(i); });

d3.select('div.breadcrumbs')
  .datum([
    { html: 'First' },
    { html: 'Second' },
    { html: 'Third' },
    { html: 'Fourth' },
  ])
  .call(breadcrumbs);

Datum Level Accessors
When the d2b breadcrumbs generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# breadcrumbs.vertical([vertical])
If vertical is specified, sets the vertical array to the specified accessor function or boolean and returns the breadcrumbs generator. If vertical is not specified, returns the current vertical accessor, which defaults to:
function (d) {
  return true;
}


# breadcrumbs.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the breadcrumbs generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d;
}

Value Level Accessors
When the d2b breadcrumbs generator is applied to a selection, the following properties will be invoked for each value in the values array. The function will be passed the value data d and the corresponding index i.
function (d) {
  // Here is what d might contain
  // d => { html: 'First' }
}


# breadcrumbs.key([key])
If key is specified, sets the key function to the specified accessor function and returns the breadcrumbs generator. If key is not specified, returns the current key accessor, which defaults to:
function (d, i) {
  return i;
}


# breadcrumbs.color([color])
If color is specified, sets the color function to the specified accessor function or color and returns the breadcrumbs generator. If color is not specified, returns the current color accessor, which defaults to:
function (d, i) {
  return 'blue';
}


# breadcrumbs.html([html])
If html is specified, sets the html function to the specified accessor function and returns the breadcrumbs generator. If html is not specified, returns the current html accessor, which defaults to:
function (d, i) {
  return d.html;
}


Styles
If using a vertical breadcrumb orientation you may want to set the width of the container.



  // ...
  d3.select('div.breadcrumbs').call(breadcrumbs);


Breadcrumb wrapping is disabled by default with the horizontal orientation. to enable this you must override the css style on the d2b-breadcrumbs class.
.d2b-breadcrumbs {
  white-space: normal !important;
}

utils/chart_frame.html.body:
d2b › Chart Frame

The d2b chartFrame component is used to render and insert several containers commonly used in a chart (e.g. breadcrumbs container, chartFrame container, chart container).

# d2b.chartFrame()
Constructs a new chartFrame generator.

# chartFrame(context)
Render the chartFrame(s) to the given context, which may be either a d3-selection of HTML containers (e.g. div) or a corresponding d3-transition.
Before applying the d2b-chartFrame generator, you may join the data to the selected element(s) using selection.data or selection.datum. By default, no properties are derived from the bound datum. Here is a basic implementation of the chartFrame.
After the chartFrame has been applied to a context, then a g.d2b-chart-container will be inserted and can be used for rendering the chart content.




  var chartFrame = d2b.chartFrame();

  chartFrame
    .breadcrumbsEnabled(true)
    .legendEnabled(false);

  var chart = d3.select('div.chart');

  chart.call(chartFrame);

  // set some breadcrumbs

  var breadcrumbs = d2b.breadcrumbs();

  breadcrumbs
    .color('steelblue');

  var breadcrumbsContainer = chart.select('.d2b-breadcrumbs-container');

  breadcrumbsContainer
    .datum([
      { html: 'First' },
      { html: 'Second' },
      { html: 'Third' },
      { html: 'Fourth' },
    ])
    .call(breadcrumbs);

  // set some breadcrumbs

  var breadcrumbs = d2b.breadcrumbs();

  breadcrumbs
    .vertical(false)
    .clickable(true)
    .dblclickable(true)
    .color('steelblue');

  var breadcrumbsContainer = chart.select('.d2b-breadcrumbs-container');

  breadcrumbsContainer
    .datum([
      { html: 'First' },
      { html: 'Second' },
      { html: 'Third' },
      { html: 'Fourth' },
    ])
    .call(breadcrumbs);

  // add something to the chart that corresponds to the inner __size__

  var chartContainer = chart.select('.d2b-chart-container');

  var innerSize = chartContainer.node().__size__;

  chartContainer
    .append('rect')
      .style('fill', 'steelblue')
      .attr('width', innerSize.width)
      .attr('height', innerSize.height)

  // update as needed..



Datum Level Accessors
When the d2b chartFrame generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# chartFrame.size([size])
If size is specified, sets the size array to the specified accessor function or object and returns the chartFrame generator. If size is not specified, returns the current size accessor, which defaults to, () => null.
If a null size is used, then it will be derived dynamically by using the the getBoundingClientRect function on the context node.

# chartFrame.legendEnabled([enabled])
If enabled is specified, sets the enabled array to the specified accessor function or boolean and returns the chartFrame generator. If enabled is not specified, returns the current enabled accessor, which defaults to () => true.
If the legend is enabled then a div.d2b-legend-container container will be available for inserting a legend, usually with the d2b.legend component. This component will have a fixed width and height based on it's default styles and the size of the outer container.

# chartFrame.legendOrient([orient])
If orient is specified, sets the orient array to the specified accessor function or string and returns the chartFrame generator. If orient is not specified, returns the current orient accessor, which defaults to () => bottom. The orient should be one of right, left, bottom, top.

# chartFrame.breadcrumbsEnabled([enabled])
If enabled is specified, sets the enabled array to the specified accessor function or boolean and returns the chartFrame generator. If enabled is not specified, returns the current enabled accessor, which defaults to () => false.
If the breadcrumbs is enabled then a div.d2b-breadcrumbs-container container will be available for inserting a breadcrumbs, usually with the d2b.breadcrumbs component. This component will have a fixed width and height based on it's default styles and the size of the outer container.

# chartFrame.breadcrumbsOrient([orient])
If orient is specified, sets the orient array to the specified accessor function or string and returns the chartFrame generator. If orient is not specified, returns the current orient accessor, which defaults to () => 'right'. The orient should be one of right, left, bottom, top.

# chartFrame.chartPadding([padding])
If padding is specified, sets the padding array to the specified accessor function, value, or object and returns the chartFrame generator. If padding is not specified, returns the current padding accessor, which defaults to () => 10. This padding is applied to the outer chart container.
The padding can be specified in the following formats:
  // If a value is given then this will be the padding on all sides of the
  // plane. (e.g. top, bottom, right, left will all be 0)
  chartFrame.chartPadding(0);
  // If an object is given then the padding for each side should be specified.
  chartFrame.chartPadding({ top: 10, bottom: 50, left: 50, right: 10 });

# chartFrame.padding([padding])
If padding is specified, sets the padding array to the specified accessor function, value, or object and returns the chartFrame generator. If padding is not specified, returns the current padding accessor, which defaults to () => 10. This padding is applied to the inner chart container.
The padding can be specified in the following formats:
  // If a value is given then this will be the padding on all sides of the
  // plane. (e.g. top, bottom, right, left will all be 0)
  chartFrame.padding(0);
  // If an object is given then the padding for each side should be specified.
  chartFrame.padding({ top: 10, bottom: 50, left: 50, right: 10 });

utils/legend.html.body:
d2b › Legend


The d2b legend component is used to render a vertical or horizontal legend.

# d2b.legend()
Constructs a new legend generator.

# legend(context)
Render the legend(s) to the given context, which may be either a d3-selection of HTML containers (e.g. div) or a corresponding d3-transition.
Before applying the d2b-legend generator, you should join the data to the selected element(s) using selection.data or selection.datum. Here is the default data format.
var color = d3.scaleOrdinal(d3.schemeCategory10);
var legend = d2b.legend();

legend
  .vertical(false)
  .clickable(true)
  .dblclickable(true)
  .color(function (d, i) { return color(i); });

d3.select('div.legend')
  .datum([
    { html: 'First' },
    { html: 'Second' },
    { html: 'Third' },
    { html: 'Fourth' },
  ])
  .call(legend);

Datum Level Accessors
When the d2b legend generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# legend.clickable([clickable])
If clickable is specified, sets the clickable array to the specified accessor function or boolean and returns the legend generator. If clickable is not specified, returns the current clickable accessor, which defaults to:
function (d) {
  return false;
}

If the legend is clickable then you can toggle the legend item's empty property by clicking on them (If an item has the property empty = true then the item's icon will appear as an outline only). When a legend item is toggled, a change event will be dispatched and bubbled up through the DOM. For example:
legend.clickable(true);

d3.select('div.legend')
  .call(legend)
  .on('change', function () {
    // Do something here, such as a chart update based on the state of each legend item
  });


# legend.dblclickable([dblclickable])
If dblclickable is specified, sets the dblclickable array to the specified accessor function or boolean and returns the legend generator. If dblclickable is not specified, returns the current dblclickable accessor, which defaults to:
function (d) {
  return false;
}

If the legend is dblclickable then you can toggle all legend items "empty" except the one being dblclicked. When a legend item is toggled, a change event will be dispatched and bubbled up through the DOM. For example:
legend.clickable(true).dblclickable(true);

d3.select('div.legend')
  .call(legend)
  .on('change', function () {
    // Do something here, such as a chart update based on the state of each legend item
  });


# legend.allowEmptied([allowEmptied])
If allowEmptied is specified, sets the allowEmptied array to the specified accessor function or boolean and returns the legend generator. If allowEmptied is not specified, returns the current allowEmptied accessor, which defaults to:
function (d) {
  return false;
}

If the legend has it's allowEmptied option set to true then it can have all of it's items with the empty = true property. However, if it's set to false then when "emptying" the last legend item, all legend items will reset their property to empty = false.

# legend.vertical([vertical])
If vertical is specified, sets the vertical array to the specified accessor function or boolean and returns the legend generator. If vertical is not specified, returns the current vertical accessor, which defaults to:
function (d) {
  return true;
}


# legend.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the legend generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d;
}

Value Level Accessors
When the d2b legend generator is applied to a selection, the following properties will be invoked for each value in the values array. The function will be passed the value data d and the corresponding index i.
function (d) {
  // Here is what d might contain
  // d => { html: 'First' }
}


# legend.key([key])
If key is specified, sets the key function to the specified accessor function and returns the legend generator. If key is not specified, returns the current key accessor, which defaults to:
function (d, i) {
  return i;
}


# legend.color([color])
If color is specified, sets the color function to the specified accessor function or color and returns the legend generator. If color is not specified, returns the current color accessor, which defaults to:
function () {
  return 'blue';
}


# legend.html([html])
If html is specified, sets the html function to the specified accessor function and returns the legend generator. If html is not specified, returns the current html accessor, which defaults to:
function (d) {
  return d.html;
}


# legend.icon([icon])
If icon is specified, sets the icon function to the specified accessor function and returns the legend generator. If icon is not specified, returns the current icon accessor, which defaults to:
function () {
  return '\uf111';
}

The specified icon can either be a font-awesome character code (e.g. \uf111 is a circle), or a d2b/d3-shape (e.g. d3.symbolSquare is a square).

# legend.empty([empty])
If empty is specified, sets the empty function to the specified accessor function and returns the legend generator. If empty is not specified, returns the current empty accessor, which defaults to:
function (d) {
  return d.empty;
}


# legend.setEmpty([setEmpty])
If setEmpty is specified, sets the setEmpty function to the specified accessor function and returns the legend generator. If setEmpty is not specified, returns the current setEmpty accessor, which defaults to:
function (d, i, state) {
  d.empty = state;
}

The setEmpty accessor is provided the empty state in addition to the value data d and index i.

utils/stack.html.body:
d2b › Stack

The d2b stack component is a wrapper for d3.stack making it easier to stack d2b graph components.

# d2b.stack()
Constructs a new stack generator.

# stack(data)
var data = [
  [
    {x: 100, y: 20},
    {x: 200, y: 410},
    {x: 300, y: 45},
    {x: 400, y: 90},
  ],
  [
    {x: 100, y: 200},
    {x: 200, y: 120},
    {x: 300, y: 310},
    {x: 400, y: 330},
  ]
];

var stacker = d2b.stack();

// retrive the d3.stack component and reconfigure the offset type
stacker.stack().offset(d3.stackOffsetExpand);

// stack the data
stacker(data);

// now each point object will have it's y0 and y1 property set
console.log(data)

Datum Level Accessors
When the d2b stack generator is applied to a selection, the following properties will be invoked. The function will be passed the element's bound datum d and the corresponding element index i.

# stack.values([values])
If values is specified, sets the values array to the specified accessor function or array and returns the stack generator. If values is not specified, returns the current values accessor, which defaults to:
function (d) {
  return d;
}

The values array should be formatted like:
[
  [/*values for the first set*/],
  [/*values for the second set*/],
  [/*values for the third set*/],
  // ...
]

Value Level Accessors
When the d2b stack generator is applied to a selection, the following properties will be invoked for each element in the values array. The function will be passed the value data d and the index position within the values array i.
function (d, i) {
  // d => {
  //   x: 1,
  //   y: 18
  // }
}


# stack.x([x])
If x is specified, sets the x accessor to the specified accessor function and returns the stack generator. If x is not specified, returns the current x accessor, which defaults to d => d.x.

# stack.y([y])
If y is specified, sets the y accessor to the specified accessor function and returns the stack generator. If y is not specified, returns the current y accessor, which defaults to d => d.y.
Other Methods

# stack.out([out])
If out is specified, sets the out function and returns the stack generator. If out is not specified, returns the current out function, which defaults to:
function (d, y0, y1) {
  d.y0 = y0;
  d.y1 = y1;
}

The out is used to specify how the y0 and y1 will be written to each value.

utils/tooltip_axis.html.body:
d2b › Tooltip Axis


The d2b tooltip-axis component allows for a tooltip to be added to an axis chart based on a set of data points. Unlike most other d2b components, tooltip-axis is limited to 1 chart per generator. Here is a simple example using the tooltip axis for two "graphs".
var svg = d3.select('svg');

// construct a graph of circles

var circleData = [
  {x: 100, y: 100, color: 'red'},
  {x: 200, y: 200, color: 'purple'},
  {x: 300, y: 300, color: 'blue'},
  {x: 400, y: 400, color: 'green'},
]

var circle = svg.selectAll('circle').data(circleData);

circle.enter()
  .append('circle')
    .attr('r', 10)
    .style('fill', function (d) { return d.color; })
    .attr('cx', function (d) { return d.x; })
    .attr('cy', function (d) { return d.y; });

// construct a graph of rects

var rectData = [
  {x: 100, y: 320, color: 'orange'},
  {x: 200, y: 36, color: 'gray'},
  {x: 300, y: 450, color: 'steelblue'},
  {x: 400, y: 310, color: 'black'},
]

var rect = svg.selectAll('rect').data(rectData);

rect.enter()
  .append('rect')
    .attr('width', 10)
    .attr('height', 10)
    .style('fill', function (d) { return d.color; })
    .attr('x', function (d) { return d.x - 5; })
    .attr('y', function (d) { return d.y - 5; });


// configure the tooltip-axis

var tooltipAxis = d2b.tooltipAxis();

tooltipAxis
  // svg container to know where to add grid markers
  .svgContainer(svg)
  // size of the axis
  .size({width: 500, height: 500})
  // title or header accessor for the tooltip
  .title(function (d) { return d[0].x; })
  // row accessor for the tooltip
  .row(function (d) { return d.y; })
  // row-color accessor for the tooltip
  .color(function (d) { return d.color; })
  // max distance that a tooltip will be generated for a set of points
  .threshold(100)
  // container where the mouse events will be bound
  .tracker(svg);

// create circle tooltip graph and supply data
tooltipAxis.graph('circle').data(circleData);

// create rect tooltip graph and supply data
tooltipAxis.graph('rect').data(rectData);


# d2b.tooltipAxis()
Constructs a new tooltipAxis generator.

# tooltipAxis.htmlContainer([selection])
If selection is specified, the html container will be set. Newly created tooltips will be placed within this container. If selection is not specified, returns the current tooltip selection. The default selection is d3.select('body').

# tooltipAxis.svgContainer([selection])
If selection is specified, the svg container will be set. The svgContainer is used to insert grid markers to illustrate the closest axis-chart point(s). It is also used to identify the (0, 0) pixel position axis relative to the document. If selection is not specified, returns the current svg container.

The svgContainer must be a svg or g element.
The top left (0, 0) corner of the svgContainer must be exactly aligned with the top left corner of the axes.


# tooltipAxis.tracker([selection])
If selection is specified, the event tracker element will be set. The tracker element is used to bind mouseover, mouseout, and mousemove tooltip events. These events are used for creating, updating, and destroying the tooltip components. If selection is not specified, returns the current tracker, which defaults to d3.select('body').

# tooltipAxis.trackX([boolean])
If boolean is specified, the x tracking will be enabled or disabled. If boolean is true the tooltip will search for points that are closest to the cursor in the horizontal direction. If boolean is false the tooltip will include the whole range of point x-values. At least one of trackX or trackY must be true. If boolean is not specified returns the current track-x boolean, which defaults to true.

# tooltipAxis.trackY([boolean])
If boolean is specified, the y tracking will be enabled or disabled. If boolean is true the tooltip will search for points that are closest to the cursor in the vertical direction. If boolean is false the tooltip will include the whole range of point y-values. At least one of trackX or trackY must be true. If boolean is not specified returns the current track-x boolean, which defaults to false.

# tooltipAxis.size([size])
If size is specified, sets the size of the axes. Size is used to properly determine the width / height of the tooltip grid-markers. Size should be an object in the format {width: 960, height: 500}. If size is not specified returns the current size.

# tooltipAxis.clear([groupName[, graphName]])
If groupName and graphName are specified, clears the specific tooltip graph data. If groupName is specified but not graphName then the data for the entire group is cleared. If no arguments are supplied, then all tooltip data will be cleared.

# tooltipAxis.title([title])
If title is specified, sets the title-accessor to the specified function or string. If title is not specified, returns the current title-accessor, which defaults to () => null. This accessor will determine what is set as the title of the tooltip when rendered. It is supplied with the set of points to be rendered as rows in the tooltip.
tooltipAxis.title( function (rows) {
  // An appropriate title might be the common x-value,
  // assuming the tooltip is used for x-tracking.
  return rows[0].x;

  // The returned title can also be html. For example,
  // if the title needs to be in italics.
  return '' + rows[0].x + '';
});

Tooltip Row Accessors
The following tooltip accessors will be invoked for each row in each of the supplied graphs. The accessors will be supplied with the point data d and index within their corresponding graph i.

# tooltipAxis.x([x])
If x is specified, sets the x-accessor to the specified function or string. If x is not specified, returns the current x-accessor, which defaults to () => d.x. The x-accessor identifies the x pixel location of each point relative to the axes.
var width = 960;
var x = d3.scaleLinear().domain([0, 100]).range([0, width]);

tooltipAxis.x( function (d) {
  return x(d.x);
});


# tooltipAxis.y([y])
If y is specified, sets the y-accessor to the specified function or string. If y is not specified, returns the current y-accessor, which defaults to () => d.y. The y-accessor identifies the y pixel location of each point relative to the axes.
var height = 500;
var y = d3.scaleLinear().domain([0, 50]).range([0, height]);

tooltipAxis.y( function (d) {
  return y(d.y);
});


# tooltipAxis.color([color])
If color is specified, sets the color-accessor to the specified function or string. If color is not specified, returns the current color-accessor, which defaults to null. The color-accessor determines what color should be associated with each row in the rendered tooltip.

# tooltipAxis.row([row])
If row is specified, sets the row-accessor to the specified function or string. If row is not specified, returns the current row-accessor, which defaults to null. This accessor will determine what is set for each row of the rendered tooltip.
tooltipAxis.row( function (d) {
  // An appropriate title might be the y-value,
  // assuming the tooltip is used for x-tracking.
  return d.y;

  // The returned title can also be html. For example,
  // if the row needs to be bold.
  return '' + d.y + '';
});


# tooltipAxis.on([type[, listener]])
Registers the specified listener to receive events of the specified type from the tooltip behavior. (see d3's dispatch for additional details.) The following events are supported:

insert  - when a tooltip is inserted
move    - when a tooltip is moved
remove  - when a tooltip is removed

Each listener will be supplied with the tooltip selection this, and input arguments for the data and selection index.
Tooltip Axis Graph
In order to populate the tooltip with point data you must specify one or more graphs.

# tooltipAxis.graph([groupName[, graphName]])
Returns the current or creates a new tooltip graph that is identified by the supplied groupName and graphName. If either groupName or graphName are unspecified, null will be used.
var graph = tooltipAxis.graph('bar', 'one');


# graph.addPoint(point)
Used to add an individual point to the graph data array.
graph.addPoint({x: 10, y: 52});


# graph.data(data)
Used to set the graph data to the supplied array of points.
graph.data([
  {x: 10, y: 52},
  {x: 20, y: 31},
  {x: 30, y: 86},
  {x: 40, y: 33},
]);


# graph.x(x)
If x is specified, sets the x-accessor to the specified function or string. If x is not specified, returns the current x-accessor. The x-accessor identifies the x pixel location of each point relative to the axes. When this accessor returns non-null it will override the tooltip's x-accessor, thus allowing the user to have custom accessors for each graph.
var width = 960;
var x = d3.scaleLinear().domain([0, 100]).range([0, width]);

graph.x( function (d) {
  return x(d.x);
});


# graph.y(y)
If y is specified, sets the y-accessor to the specified function or string. If y is not specified, returns the current y-accessor. The y-accessor identifies the y pixel location of each point relative to the axes. When this accessor returns non-null it will override the tooltip's y-accessor, thus allowing the user to have custom accessors for each graph.
var height = 500;
var y = d3.scaleLinear().domain([0, 100]).range([0, height]);

graph.y( function (d) {
  return y(d.y);
});


# graph.color(color)
If color is specified, sets the color-accessor to the specified function or string. If color is not specified, returns the current color-accessor. The color-accessor determines what color should be associated with each row in the rendered tooltip. When this accessor returns non-null it will override the tooltip's color-accessor, thus allowing the user to have custom accessors for each graph.

# graph.row(row)
If row is specified, sets the row-accessor to the specified function or string. If row is not specified, returns the current row-accessor. This accessor will determine what is set for each row of the rendered tooltip. When this accessor returns non-null it will override the tooltip's row-accessor, thus allowing the user to have custom accessors for each graph.
graph.row( function (d) {
  // An appropriate title might be the y-value,
  // assuming the tooltip is used for x-tracking.
  return d.y;

  // The returned title can also be html. For example,
  // if the row needs to be bold.
  return '' + d.y + '';
});


Using Tooltip Axis with a d2b-graph
All of the d2b-graph types can be configured to easily use the tooltip-axis. To do this simply supply each graph object with it's own tooltipAxis.graph. The example below is for a line graph but this functionality extends to all graph types.
var line = d2b.svgLine(),
    x = d3.scaleLinear().domain([1, 5]).range([0, 960]),
    y = d3.scaleLinear().domain([100, 0]).range([0, 500]);

line.x(x).y(y);

var svg = d3.select('svg');

// construct and confiture the tooltip axis
var tooltipAxis = d2b.tooltipAxis();

tooltipAxis
  .svgContainer(svg)
  .tracker(svg)
  .title(function (d) { return d[0].x; })
  .row(function (d) { return d.y; })
  .size({width: 960, height: 500});

svg
  .datum([
    {
      label: 'Line Graph 1',
      // add a tooltip graph for the first line graph
      tooltipGraph: tooltipAxis.graph('line', 'graph 1'),
      values: [
        { x: 1, y: 22 },
        { x: 2, y: 41 },
        { x: 3, y: 36 },
        { x: 4, y: 51 },
        { x: 5, y: 10 }
      ]
    },
    {
      label: 'Line Graph 2',
      // and for the second line graph
      tooltipGraph: tooltipAxis.graph('line', 'graph 2'),
      values: [
        { x: 1, y: 12 },
        { x: 2, y: 15 },
        { x: 3, y: 60 },
        { x: 4, y: 31 },
        { x: 5, y: 40 }
      ]
    }
  ])
  .call(line);

utils/tween_arc.html.body:
d2b › Tween Arc


This function is used to tween a d3.arc from one position to another.

# d2b.tweenArc(context, arc)
Tween the context arc, which may be either a d3-selection of svg path elements or a corresponding d3-transition.
The previous arc will be derived from the node's this.current "sticky" property.
The arc should be a d3-arc. This will help the tween function locate the arc properties (e.g. innerRadius, outerRadius, startAngle, endAngle).

var arc = d3.arc();

arc
  .innerRadius(function (d) { return d.innerRadius; })
  .outerRadius(function (d) { return d.outerRadius; })
  .startAngle(function (d) { return d.startAngle; })
  .endAngle(function (d) { return d.endAngle; });

var path = d3.select('path');

path
    .datum({
      innerRadius: 140,
      outerRadius: 150,
      startAngle: 0,
      endAngle: Math.PI / 2
    })
    .call(d2b.tweenArc, arc);

setTimeout(function () {
  path
      .datum({
        innerRadius: 30,
        outerRadius: 150,
        startAngle: Math.PI / 3,
        endAngle: Math.PI * 2
      })
    .transition()
      .duration(1000)
      .call(d2b.tweenArc, arc);
}, 2000);

For every tick of the tweening transition or the instantaneous update when no transition is used, the current state of the arc will be saved on the node's this.current property. This means that only one d2b tween should be applied to a specific node. If multiple tweens are needed it is recommended to use nested containers each with their own tween.

utils/tween_centroid.html.body:
d2b › Tween Centroid


This function is used to tween a centroid from one position to another.

# d2b.tweenCentroid(context, arc, [rotate])
Tween the context centroid position, which may be either a d3-selection of svg path elements or a corresponding d3-transition.
The previous centroid will be derived from the node's this.current "sticky" property.
The arc should be a d3-arc. This will help the tween function locate the centroid properties (e.g. innerRadius, outerRadius, startAngle, endAngle).
Additionally, a rotate accessor may be supplied as a function or degree value. This will be used to decide the rotation transformation to be used in tweening the context.

var arc = d3.arc();

arc
  .innerRadius(function (d) { return d.innerRadius; })
  .outerRadius(function (d) { return d.outerRadius; })
  .startAngle(function (d) { return d.startAngle; })
  .endAngle(function (d) { return d.endAngle; });

var path = d3.select('path'),
    text = d3.select('text');

var datum = {
  innerRadius: 140,
  outerRadius: 150,
  startAngle: 0,
  endAngle: Math.PI / 2
};

path
    .datum(datum)
    .call(d2b.tweenArc, arc);

text
    .datum(datum)
    .call(d2b.tweenCentroid, arc);

Every tick of the tweening transition or the instantaneous update when no transition is used, the current state of the centroid position will be saved on the node's this.current property. This means that only one d2b tween should be applied to a specific node. If multiple tweens are needed it is recommended to use nested svg g containers.

utils/tween_number.html.body:
d2b › Tween Number


This function is used to tween a number from one value to another.

# d2b.tweenNumber(context, [number, [format]])
Tween the context number from one value to another, which may be either a d3-selection of html or svg text elements or a corresponding d3-transition.
A number accessor may be supplied as a function or value. This will be the target value for the tween. The previous value will be derived from the node's this.current "sticky" property.
Additionally, a format function may be supplied to format each tick of the tween.

var div = d3.select('div'),
    format = d3.format(',.2f');

div.call(d2b.tweenNumber, 100, format);

setTimeout(function () {
  div
    .transition()
      .duration(1000)
      .call(d2b.tweenNumber, 122.8, format);
}, 2000);

For every tick of the tweening transition or the instantaneous update when no transition is used, the current state of the number will be saved on the node's this.current property. This means that only one d2b tween should be applied to a specific node. If multiple tweens are needed it is recommended to use nested containers each with their own tween.
